INSERT INTO `blog_post` VALUES (1,'sandakphu_revisited','https://lh5.googleusercontent.com/-8Y49mowRXB4/VP3pzHIKqaI/AAAAAAAACyo/WctaWpmKEbQ/w1341-h894-no/DSC_0438.JPG','2015-03-06 01:05:01','Pratik Sengupta','Sandakphu Revisited','2017-01-05 13:58:12','Pratik Sengupta','Breakfree into natures lap @Sandakphu',NULL,'<!-- Post Content -->\r\n                <p class=\"lead\">Breakfree into natures lap @Sandakphu</p>\r\n\r\n                <p><i>Sandakphu</i> the highest peak of west Bengal is situated at the edge of the Singalila National Park in\r\n                Darjeeling district on the West Bengal-Nepal border, and is the highest point of the Singalila Ridge. Kangchenjunga, Lhotse and Makalu can be seen\r\n                from its summit. </p>\r\n                \r\n                <p>When I looked at the calendar and found 2 consecutive holidays on Thursday and Friday, the first thing that popped up my mind was\r\n                to plan for a short trip. A trek plan in four days sounds impossible but my love for this place forced me to tweak it somewhere and go for it.\r\n                Normally it takes 5 days (3 days uphill trek and 2 days downhill trek) to reach <i>Sandakphu</i> but there is also a possibility to hire Land Rover\r\n                vehicles as well. So our plan was <br>\r\n                </p><ul>\r\n                    <li>Day 1 (Wednesday night after office): Board train at <i>Sealdah</i> to <i>New Jalpaiguri</i></li>\r\n                    <li>Day 2: <i>New Jalpaiguri</i> to Dhotre and then trek 5 kilometers to <i>Tonglu</i></li>\r\n                    <li>Day 3: <i>Tonglu</i> to <i>Sandakphu</i> (hiring Land Rover Jeeps to cover some part of the road)</li>\r\n                    <li>Day 4: <i>Sandakphu</i> to <i>Srikhola</i></li>\r\n                    <li>Day 5: <i>Srikhola</i> to <i>New Jalpaiguri</i> via <i>Rimbik</i></li>\r\n                    <li>Day 6: Board train from <i>New Jalpaiguri</i> and reach <i>Sealdah</i> in the morning and join Office :(</li>\r\n                </ul>\r\n                <p></p>\r\n\r\n        <p class=\"lead\">Day 1: <i>Sealdah</i> to <i>New Jalpaiguri</i></p>\r\n        <p>Take a night train from <i>Sealdah</i> Railway station to <i>New Jalpaiguri</i> (NJP). There are quite a few trains but Darjeeling Mail and Padatik Express are\r\n        the most preferred one. We were four enthusiasts and our train, Padatik Express departed from <i>Sealdah</i> on its scheduled time at 10:55 pm.</p>\r\n\r\n        <p class=\"lead\">Day 2: <i>New Jalpaiguri</i> to <i>Tonglu</i> Top</p>\r\n        We arrived NJP by 9:00 am in the morning. We went to <b>Darjeeling More</b> by auto rickshaw which costs around Rs. 30 per person. From there we\r\n        booked a shared trekker (cab) which took us to Sukhiapokhri (Rs. 140 per person). We arrived there at around 1:30 pm. From there we hired an Omni\r\n        for Rs 1500 which took us to Dhotre (should have bargained here, as the reasonable cost seems to be around 1k). We reached Dhotre at around 3:30 pm.\r\n        There are 2 trekking routes to <i>Sandakphu</i>. One starts from <i>Manebhanjan</i> which is 31 km and the other shorter route from <i>Dhotre</i> (27 km).\r\n        The route via Dhotre passes through the Dense Singalilia forest. Both the routes meet at Tumling a small Hamlet in Nepal and takes 3 days to reach\r\n        <i>Sandakphu</i> normally. The entire trail to <i>Sandakphu</i> is along the borders of India and Nepal. One has to take along a guide to enter the Singalilia\r\n        National Park. We chose to trek from Dhotre since we were already late. Even the local people suggested us to take rest at Dhotre overnight and\r\n        start the next day but for a Software Engineer the most precious thing is <i>Leaves</i> and spending the night at Dhotre would mean that the plan to\r\n        <i>Sandakphu</i> would be in jeopardy. So we decided to start withing 10 mins of reaching here and had just Momos in lunch. We booked a guide from the\r\n        local Guide Office at Dhotre. Since it was already late and it\'s quite risky to complete the trek to <i>Tonglu</i> at night, we are given a very\r\n        experienced guide.\r\n\r\n        <p>The rate for hiring a guide was Rs. 550 per day. We started our trek at 3:40 pm and soon we entered the dense park. The route is well marked and\r\n        hardly any chance of wandering into the forest.As soon we have coverd hardly half kilometers,we saw two gentelman with another guide resting their\r\n        for minute.We are happy to get another three people for the journey.Our guide provided us some bamboo sticks,which helped us throughout our\r\n        journey!It was 5:30pm when the sun had already set but still the daylight kept us going till we reached <i>Tonglu</i> top at 6:00 pm. the guide said that\r\n        at this time of year days are longer for which we could easliy make it to <i>Tonglu</i> top before dusk.By the time we reached there ,weather started to\r\n        become chilly with bone-chilling winds. we got into the trekkers hut booked earlier by our guide.the charge was rs.130 per bed but it was worth it\r\n        because the interiors was awesome with windows facing the mighty kanchenjunga. We had dinner as there people have dinner early at 7:00 pm(Rs.150 per\r\n        meal).After having dinner we got into our room provided with some candles which was not enough for us but we were helped by our natural satelite\r\n        Moon. As it was a full moon night we hardly needed any candle because the silver rays were enough. Savouring the natural beauty we went to sleep but\r\n        at midnight we got to witness some breathtaking scenes which was ofcourse was the snow covered kanchenjunga shining in the silver rays of moon with\r\n        stars adding up to its shimmering beauty.</p>\r\n\r\n\r\n\r\n        <div class=\"travelImg\">\r\n            <img alt=\"Gopal Chettri\" src=\"https://lh6.googleusercontent.com/-tLpcyXaFasg/VQRcQZRDb5I/AAAAAAAACzc/4DQ_TO3DFpI/w1341-h894-no/DSC_0183.JPG\">\r\n        </div>\r\n\r\n\r\n\r\n\r\n        <br>\r\n        <p class=\"lead\">Day 3: <i>Tonglu</i> to <i>Sandakphu</i> (<i>Garibash</i> to Bikheybhanjang on Land Rover vehicle)</p>\r\n\r\n        <div class=\"travelImg\">\r\n            <a href=\"https://lh3.googleusercontent.com/ZTDNaIEGV2kVLqhUrkElLbRShGqg7XOe2IkXkQmBhVU=w1341-h894-no\"> <img alt=\"Sleeping Buddha\" src=\"https://lh3.googleusercontent.com/ZTDNaIEGV2kVLqhUrkElLbRShGqg7XOe2IkXkQmBhVU=w338-h225-p-no\">\r\n            </a>\r\n        </div>\r\n        <br>\r\n        <p>One must get up early at 5:00 am to witness the changing beauty of Kanchenjunga from lying quiet in the silver rays of moonlight to shining in the\r\n        golden rays of Sun, the so called \"golden peak\". As the trek for the third day was long so we started early after having breakfast to reach\r\n        <i>Sandakphu</i> within time, passing another settlement - Tunmling. We got our permission from a checkpost to enter Singalila National forest. Few\r\n        kilometer on a gentle downhill there lies <i>Jaubari</i> (Nepal). The route to <i>Sandakphu</i> turns right from here along the Singalilia ridge which\r\n        coincidentally is also the border of Nepal and India. We shared momos and thuppa here. Four kilometers downhill from <i>Jaubari</i> takes us to <i>Garibash</i>.\r\n        The route was not that tough as it was a wide one with ups and downs to reach <i>Garibash</i>. We reached <i>Garibash</i> at around 11:00 am, had Roti and Sabji\r\n        in lunch. Since we had a day short in our plan, we were forced to cover a few kilometers on Jeep to save some time. So we booked a Jeep which took\r\n        us to Bikheybhanjang (Bikhey - a poisinous herb, bhanjang - a valley) beyond which it was not possible for even the Land Rovers to move. On the way\r\n        we passed Kalapokhri (Kala - Black, Pokhri - Pong) another settlement from there the weather started to become foggy and chilly, visibility reduced\r\n        to 1-2 meters. But our driver was experienced one and he was driving as if playing NFS !!! with all the turns within his mind and in our mind ? GOD\r\n        ofcourse. Co-incidentally it was the most difficult part of the trek which we covered on Land Rover :(\r\n        </p>\r\n        <div class=\"travelImg\">\r\n            <a href=\"https://lh3.googleusercontent.com/-uo9b_c78qtc/VP3pY5g3r9I/AAAAAAAACyo/RGUmsCUlAd8/w1341-h894-no/DSC_0312.JPG\"> <img alt=\"\" src=\"https://lh3.googleusercontent.com/ipQJBDMq5iOMhUGtdfZZeucE9QwAWPujQigs4O_0Tvc=w338-h225-p-no\">\r\n            </a>\r\n        </div>\r\n\r\n        <p>From there we started our most highlighted part of trek, the last few kilometers covered with snow which thicked as we approached near <i>Sandakphu</i>.\r\n        Few shortcuts made it shorter thanks to the guide who helped us to save some energy! We were mesmerised to see snow covered <i>Sandakphu</i>, after parting\r\n        with our bag and baggages at one of the lodgings arranged beforehand at Rs.165 per bed went outside to enjoy the weather and landscape, clicked many\r\n        photographs and played with snow !.</p>\r\n\r\n        <div class=\"travelImg\">\r\n            <a href=\"https://lh5.googleusercontent.com/-8Y49mowRXB4/VP3pzHIKqaI/AAAAAAAACyo/WctaWpmKEbQ/w1341-h894-no/DSC_0438.JPG\"> <img alt=\"\" src=\"https://lh3.googleusercontent.com/DZwG9nZY99aVBMmBGQc5PPcb6l-gR3zpBKU_UdTfHug=w338-h225-p-no\">\r\n            </a>\r\n        </div>\r\n        <p>But this didn\'t last long as the weather was detoriating with biting cold with freezing winds making us numb. We rested for an hour and had dinner\r\n        at 7:00 pm Rs.150 per plate and went to sleep. All lights switch off after 9:00 pm as there is no electricity but a few solar panels which harldy\r\n        accumulates enough energy due to overcast weather conditions after noon.</p>\r\n\r\n        <div class=\"travelImg\">\r\n            <a href=\"https://lh3.googleusercontent.com/-WDGoF_5cQYY/VP3puH6i3WI/AAAAAAAACyo/V8-WVSQwH_U/w1341-h894-no/DSC_0422.JPG\"> <img alt=\"\" src=\"https://lh3.googleusercontent.com/L2jUJLc7W7Vge-s0Jgst6whJuHvzICwqdJRnxzIFKAQ=w338-h225-p-no\">\r\n            </a>\r\n        </div>\r\n\r\n        <br>\r\n        <p class=\"lead\">Day 4: <i>Sandakphu</i> to <i>Srikhola</i></p>\r\n        <p>To catch the glimpse of khangchendzonga we got up early at 5:00 am and then came the moment were we got to witness sun rising gradually covering khangchendzonga&nbsp;with its golden rays and moon and sun on opposite ends of sky.</p>\r\n        <div class=\"travelImg\">\r\n            <a href=\"https://lh3.googleusercontent.com/-ZZmF3wUhXF4/VP3p4xjr0aI/AAAAAAAACyo/wv02ciHuqsc/w1341-h894-no/DSC_0468.JPG\"> <img alt=\"\" src=\"https://lh3.googleusercontent.com/Rr8wvm5k0ptOPzGnUzovcteklCve-vbgduh5NBN2wAQ=w338-h225-p-no\">\r\n            </a>\r\n        </div>\r\n        <div class=\"travelImg\">\r\n            <a href=\"https://lh5.googleusercontent.com/V8HYGr8d_gN-wrt6PgYYaKxRrIK74X4VEYG9XWIaRGk=w1341-h894-no\"> <img alt=\"\" src=\"https://lh3.googleusercontent.com/V8HYGr8d_gN-wrt6PgYYaKxRrIK74X4VEYG9XWIaRGk=w338-h225-p-no\">\r\n            </a>\r\n        </div>\r\n\r\n\r\n        <p>within few moments we also got to savour many of the 8k+ peaks of the Himalayan range - Mt Everest, Makalu, Lhotse, Three Sisters, Kumbhakarna, Mt.\r\n        Khangchendzonga and Pandim. One can also see the Eastern peaks of Arunachal when the weather is absolutely clear but we couldn\'t. Time stood still\r\n        and we just watched in awe - the beauty of the Himalayas. </p>\r\n\r\n        <p>We had to trek 17 kilometres to <i>Srikhola</i> for our night stay for which we\r\n        started early after enjoying the beauty of <i>Sandakphu</i>. One must start early to avoid steep slippery trail downhill coz as the snow starts melting it\r\n        makes the downward trek risky. Initially the snow covered route was tough as the snow was melting but after 4-5 kilometers downhill the snow\r\n        disappeared. The view on the way was magnificent one can see Khangchendzonga, three sisters etc.</p>\r\n        <div class=\"travelImg\">\r\n            <a href=\"https://lh4.googleusercontent.com/-rl8b4To77eU/VP3p_BWZS3I/AAAAAAAACyo/0IzSOAaJOvQ/w1341-h894-no/DSC_0521.JPG\"> <img alt=\"\" src=\"https://lh3.googleusercontent.com/lDakiGU4CrrQOApMqA6CknQg_IcSQGknEpyoNuMToYI=w338-h225-p-no\">\r\n            </a>\r\n        </div>\r\n\r\n        <p>We had goose bumps passing through the dense Bamboo forest and then through sloping terrain covered with Rhododendron and Magnolia.</p>\r\n        <div class=\"travelImg\">\r\n            <a href=\"https://lh4.googleusercontent.com/-F8zPz7trOuc/VP3qGZuBSfI/AAAAAAAACyo/exHhMWTxwCQ/w596-h894-no/DSC_0570.JPG\"> <img alt=\"\" src=\"https://lh3.googleusercontent.com/Cs-WZL-_hNXImX9Nrw6k3hO-6eq_qaYGKwJVczQSUlE=w136-h202-p-no\">\r\n            </a>\r\n        </div>\r\n\r\n\r\n        <p>One can rest in between the journey to regain energy. We passed through that part of forest which got burnt in 1980\'s after which our next halt was\r\n        <i>Gurdum</i> which was at 14 kilometres from <i>Sandakphu</i>. In case of emergency one can hire a pony from <i>Gurdum</i>. A good guide can arrange it over phone if he\r\n        has good contacts. One of our fellow trekker was unable to continue and he hired a pony. We reached Gordum at around 1:00 pm and had lunch. In my\r\n        last trek to <i>Sandakphu</i> in 2012 we stayed at <i>Gurdum</i> at Himalayan Sherpa Lodge. But this time we trekked down further to <i>Srikhola</i>, 4 kilometres from\r\n        Gordum along a rouring stream and reached there by 4:00 pm.</p>\r\n        <div class=\"travelImg\">\r\n            <a href=\"https://lh4.googleusercontent.com/-tE-aXtR2i8I/VP3qJ-WK6oI/AAAAAAAACyo/JVOxpS6qD4c/w1341-h894-no/DSC_0576.JPG\"> <img alt=\"\" src=\"https://lh3.googleusercontent.com/ah2EEF7F4tr6HqKDgD5ZYeK6pvcpBZ3TSwPaGW3-_YU=w304-h202-p-no\">\r\n            </a>\r\n        </div>\r\n\r\n\r\n        <p>We were so tired that we could hardly take another step and each and every muscle in our body was aching. We stayed at the Red Panda hotel on the\r\n        bank of Sirikhola (Khola - river). After taking shower with warm water we seemed to regain some strength to hang around at the river bank. We had\r\n        egg curry in dinner and went to sleep as the next day we had booked a jeep from <i>Rimbik</i> which was 4 kilometres trek from <i>Srikhola</i>. One can also get a\r\n        jeep to <i>New Jalpaiguri</i> from <i>Srikhola</i> but there is only one that leaves <i>Srikhola</i> at 6:00 am in the morning.</p>\r\n\r\n\r\n\r\n        <p class=\"lead\">Day 5: <i>Srikhola</i> to <i>Rimbik</i> to <i>New Jalpaiguri</i></p>\r\n        <p>After having breakfast we started at 9:00 am reluctantly as we were groaning in pain but as soon as we started we got used to it. The trek to <i>Rimbik</i>\r\n        was easy as it was almost normal road. We were very near to Sikkim border one can see sikkim on the other side of the hill. A kilometer from\r\n        <i>Srikhola</i> the two streams (<i>Srikhola</i> and river Rammam) meets. The river Rammam acts as the border between Sikkim and West Bengal.</p>\r\n        <div class=\"travelImg\">\r\n            <a href=\"https://lh6.googleusercontent.com/-hFejM_j-wWU/VP3qNUKgDEI/AAAAAAAACyo/gP2F0l5ygtQ/w1341-h894-no/DSC_0603.JPG\"> <img alt=\"\" src=\"https://lh3.googleusercontent.com/HbwPGq3HmbQerJmy_k1kQTLrvk3PKANJKGnDa0AudPY=w338-h225-p-no\">\r\n            </a>\r\n        </div>\r\n\r\n        <p>We reached <i>Rimbik</i> by 11:00 am and boarded the jeep to Sukhiyapokhri which was booked earlier by our friend cum guide Gopal, for Rs.160 per person.\r\n        If anyone is looking for a guide in this route the Mr. Gopal Chettri is definitely recommended and I have shared his contact details below as well.\r\n        On the way we got down at Dhotre the Jeep stopped for lunch, but I went it straight to Dhotre View point to get a glimpse along with my D3300.We\r\n        reached Sukhiapokhri at 2:30 pm from where we got into other jeep to <i>New Jalpaiguri</i> for Rs.140 per person. We reached <i>New Jalpaiguri</i> by 5:00 pm as\r\n        it was all foggy there. We had dinner at <i>New Jalpaiguri</i> railway station and waited for our train, Padatik Express which was scheduled at 9:00 pm.</p>\r\n\r\n\r\n\r\n\r\n        <p class=\"lead\">Essentials for this Trip</p>\r\n        <ul>\r\n            <li>Trekking/ Walking Shoe</li>\r\n            <li>Cotton Socks</li>\r\n            <li>Gluffs</li>\r\n            <li>Candles</li>\r\n            <li>Sandals or Floaters</li>\r\n            <li>Water Bottle</li>\r\n            <li>Earthen/Natural colored clothes – Jeans is absolutely not recommended</li>\r\n            <li>Warm Clothings (It’s expected to be quite cold at Mul Pokhari)</li>\r\n            <li>Sun Cap</li>\r\n            <li>Rain-coat</li>\r\n            <li>Personal Medicines, Band Aid, Crepe Bandage, etc.</li>\r\n            <li>Toilet Paper</li>\r\n            <li>Soap/ Soap Paper/ Hand Sanitizer</li>\r\n            <li>Torch Light</li>\r\n            <li>Spare Newspaper</li>\r\n            <li>Spare Plastic Carry Bags</li>\r\n            <li>Photo Id Proof (Both Original and Photocopy)</li>\r\n            <li>Camera</li>\r\n        </ul>\r\n\r\n        <p>Note: All photographs in this site are either taken by me or by my friends.</p><br> <br>\r\n\r\n        <p class=\"lead\">Contact Details of our friend and Guide - Mr. Gopal Chettri</p>\r\n        <div class=\"travelImg\">\r\n            <a href=\"https://www.facebook.com/gopal.chettri1\"> <img alt=\"Gopal Chettri\" src=\"https://lh3.googleusercontent.com/ogV4cblsA6XGeSdWxioZmbRdClfC5cb-besyDegwu2w=w311-h207-p-no\"> <br>Gopal Chettri\r\n            </a> <br> Ph: +91 9434309606\r\n        </div>\r\n                <hr>','COMPLETE','sandakphu, khangchendzonga, trek, nature, tonglu, darjeeling'),(11,NULL,'','2015-12-06 00:24:22','Pratik Sengupta','Spring Complete Annotation Based Config','2015-12-06 00:24:22','Pratik Sengupta',NULL,NULL,'<p style=\"margin-bottom: 16px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">Here is how we can configure a spring based Java Web Project without any xml configurations (even skipping the web.xml !). This is made pretty easy by the&nbsp;<code style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; padding: 0.2em 0px; margin: 0px; border-radius: 3px; background-color: rgba(0, 0, 0, 0.0392157);\">org.springframework.web.servlet.support.AbstractAnnotationConfigDispatcherServletInitializer&nbsp;</code>&nbsp;class of spring-webmvc.</p><p style=\"margin-bottom: 16px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">The code can be downloaded and the testcases can be executed as it is.</p><p style=\"margin-bottom: 16px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\"><br></p><hr style=\"height: 4px; margin: 16px 0px; overflow: hidden; border-top-width: 0px; border-style: none; padding: 0px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px; background: rgb(231, 231, 231);\"><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-1-add-maven-dependencies\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/spring-annotation-webconfig.html#1-add-maven-dependencies\" aria-h