x; background: rgb(231, 231, 231);\"><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-3-configure-the-spring-controller\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/spring-annotation-webconfig.html#3-configure-the-spring-controller\" aria-hidden=\"true\" style=\"color: rgb(65, 131, 196); position: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>3. Configure the Spring Controller</h3><div class=\"highlight highlight-java\" style=\"margin-bottom: 16px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\"><pre style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin-bottom: 0px; font-stretch: normal; line-height: 1.45; padding: 16px; border-radius: 3px; word-wrap: normal; word-break: normal; background-color: rgb(247, 247, 247);\">				<span class=\"pl-k\" style=\"color: rgb(167, 29, 93);\">package</span> <span class=\"pl-smp\">com.prapps.tutorial.spring.controller</span>;\n\n<span class=\"pl-k\" style=\"color: rgb(167, 29, 93);\">import</span> <span class=\"pl-smi\">org.springframework.stereotype.Controller</span>;\n<span class=\"pl-k\" style=\"color: rgb(167, 29, 93);\">import</span> <span class=\"pl-smi\">org.springframework.web.bind.annotation.RequestMapping</span>;\n\n@<span class=\"pl-stj\">Controller</span>\n<span class=\"pl-s\" style=\"color: rgb(167, 29, 93);\">public</span> <span class=\"pl-s\" style=\"color: rgb(167, 29, 93);\">class