e=\"color: rgb(99, 163, 92);\">version</span>&gt;\r\n        &lt;/<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">dependency</span>&gt;\r\n        &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">dependency</span>&gt;\r\n            &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">groupId</span>&gt;com.google.inject&lt;/<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">groupId</span>&gt;\r\n            &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">artifactId</span>&gt;guice&lt;/<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">artifactId</span>&gt;\r\n            &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">version</span>&gt;3.0&lt;/<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">version</span>&gt;\r\n        &lt;/<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">dependency</span>&gt;\r\n    &lt;/<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">dependencies</span>&gt;\r\n&lt;/<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">project</span>&gt;</pre></div><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-2-create-the-project-structure\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/google-guice.html#2-create-the-project-structure\" aria-hidden=\"true\" style=\"color: rgb(65, 131, 196); position: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>2. Create the project structure</h3><p style=\"margin-bottom: 16px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\"><img src=\"http://apps-pratiks.rhcloud.com/resources/images/tutorials/project_structure-google-guice.png\" alt=\"project structure\" style=\"max-width: 100%;\"></p><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-3-vo-class\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/google-guice.html#3-vo-class\" aria-hidden=\"true\" style=\"color: rgb(65, 131, 196); position: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>3. VO class</h3><pre style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin-bottom: 16px; font-stretch: normal; line-height: 1.45; padding: 16px; border-radius: 3px; word-wrap: normal; background-color: rgb(247, 247, 247);\">		<code style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin: 0px; border-radius: 3px; word-break: normal; white-space: pre; border: 0px; display: inline; max-width: initial; overflow: initial; line-height: inherit; word-wrap: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">package com.prapps.tutorial.guice.vo;\r\n\r\npublic class Employee {\r\n\r\n    private long id;\r\n    private String name;\r\n    private double salary;\r\n\r\n    public long getId() {\r\n        return id;\r\n    }\r\n    public void setId(long id) {\r\n        this.id = id;\r\n    }\r\n    public String getName() {\r\n        return name;\r\n    }\r\n    public void setName(String name) {\r\n        this.name = name;\r\n    }\r\n    public double getSalary() {\r\n        return salary;\r\n    }\r\n    public void setSalary(double salary) {\r\n        this.salary = salary;\r\n    }\r\n}\r\n</code>\r\n	</pre><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-4-service-interface\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/google-guice.html#4-service-interface\" aria-hidden=\"true\" style=\"color: rgb(65, 131, 196); position: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>4. Service Interface</h3><pre style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin-bottom: 16px; font-stretch: normal; line-height: 1.45; padding: 16px; border-radius: 3px; word-wrap: normal; background-color: rgb(247, 247, 247);\">		<code style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin: 0px; border-radius: 3px; word-break: normal; white-space: pre; border: 0px; display: inline; max-width: initial; overflow: initial; line-height: inherit; word-wrap: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">package com.prapps.tutorial.guice.service.api;\r\n\r\nimport java.util.Collection;\r\n\r\nimport com.prapps.tutorial.guice.vo.Employee;\r\n\r\npublic interface EmployeeService {\r\n\r\n    void addEmployee(Employee employee);\r\n\r\n    Collection&lt;Employee&gt; searchEmployeeByName(String name);\r\n\r\n    Employee searchEmployeeById(Long id);\r\n}\r\n</code>\r\n	</pre><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-5-serviceimpl-class\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/google-guice.html#5-serviceimpl-class\" aria-hidden=\"true\" style=\"color: rgb(65, 131, 196); position: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>5. ServiceImpl class</h3><pre style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin-bottom: 16px; font-stretch: normal; line-height: 1.45; padding: 16px; border-radius: 3px; word-wrap: normal; background-color: rgb(247, 247, 247);\">		<code style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin: 0px; border-radius: 3px; word-break: normal; white-space: pre; border: 0px; display: inline; max-width: initial; overflow: initial; line-height: inherit; word-wrap: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">package com.prapps.tutorial.guice.service.impl;\r\n\r\nimport java.util.ArrayList;\r\nimport java.util.Collection;\r\nimport java.util.HashMap;\r\nimport java.util.Map;\r\nimport java.util.Map.Entry;\r\n\r\nimport com.prapps.tutorial.guice.service.api.EmployeeService;\r\nimport com.prapps.tutorial.guice.vo.Employee;\r\n\r\npublic class EmployeeServiceImpl implements EmployeeService {\r\n\r\n    private Map&lt;Long, Employee&gt; employeeMap = new HashMap&lt;Long, Employee&gt;();\r\n\r\n    public void addEmployee(Employee employee) {\r\n        employeeMap.put(employee.getId(), employee);\r\n    }\r\n\r\n    public Collection&lt;Employee&gt; searchEmployeeByName(String name) {\r\n        Collection&lt;Employee&gt; result = new ArrayList&lt;Employee&gt;();\r\n        for(Entry&lt;Long, Employee&gt; entry : employeeMap.entrySet()) {\r\n            if(entry.getValue().getName().equals(name)) {\r\n                result.add(entry.getValue());\r\n            }\r\n        }\r\n        return result;\r\n    }\r\n\r\n    public Employee searchEmployeeById(Long id) {\r\n        return employeeMap.get(id);\r\n    }\r\n\r\n}\r\n</code>\r\n	</pre><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-6-logger-class\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/google-guice.html#6-logger-class\" aria-hidden=\"true\" style=\"color: rgb(65, 131, 196); position: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>6. Logger class</h3><pre style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin-bottom: 16px; font-stretch: normal; line-height: 1.45; padding: 16px; border-radius: 3px; word-wrap: normal; background-color: rgb(247, 247, 247);\">		<code style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin: 0px; border-radius: 3px; word-break: normal; white-space: pre; border: 0px; display: inline; max-width: initial; overflow: initial; line-height: inherit; word-wrap: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">package com.prapps.tutorial.guice.aop;\r\n\r\nimport org.aopalliance.intercept.MethodInterceptor;\r\nimport org.aopalliance.intercept.MethodInvocation;\r\nimport org.apache.log4j.Logger;\r\n\r\npublic class LogAspect implements MethodInterceptor {\r\n\r\n    private static final Logger LOG = Logger.getLogger(LogAspect.class);\r\n\r\n    public Object invoke(MethodInvocation invocation) throws Throwable {\r\n        LOG.trace(invocation.getMethod());\r\n        if(null != invocation.getArguments() &amp;&amp; invocation.getArguments().length &gt; 0) {\r\n            for(Object arg : invocation.getArguments()) {\r\n                LOG.trace(arg.getClass() + \" -- \" + arg);\r\n            }\r\n        }\r\n        Object response = invocation.proceed();\r\n        LOG.trace(response);\r\n        return response;\r\n    }\r\n\r\n\r\n}\r\n</code>\r\n	</pre><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-7-injector-class\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/google-guice.html#7-injector-class\" aria-hidden=\"true\" style=\"color: rgb(65, 131, 196); position: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>7. Injector class</h3><pre style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin-bottom: 16px; font-stretch: normal; line-height: 1.45; padding: 16px; border-radius: 3px; word-wrap: normal; background-color: rgb(247, 247, 247);\">		<code style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin: 0px; border-radius: 3px; word-break: normal; white-space: pre; border: 0px; display: inline; max-width: initial; overflow: initial; line-height: inherit; word-wrap: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">package com.prapps.tutorial.guice.ioc;\r\n\r\nimport com.google.inject.AbstractModule;\r\nimport com.google.inject.Singleton;\r\nimport com.google.inject.matcher.Matchers;\r\nimport com.prapps.tutorial.guice.aop.LogAspect;\r\nimport com.prapps.tutorial.guice.service.api.EmployeeService;\r\nimport com.prapps.tutorial.guice.service.impl.EmployeeServiceImpl;\r\n\r\npublic class EmployeeAppInjector extends AbstractModule {\r\n\r\n    @Override\r\n    protected void configure() {\r\n        bind(EmployeeService.class).to(EmployeeServiceImpl.class).in(Singleton.class);\r\n        LogAspect logAspect = new LogAspect();\r\n        requestInjection(logAspect);\r\n        bindInterceptor(Matchers.subclassesOf(EmployeeService.class), Matchers.any(), logAspect);\r\n    }\r\n}\r\n</code>\r\n	</pre><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-8-tester-class\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/google-guice.html#8-tester-class\" aria-hidden=\"true\" style=\"color: rgb(65, 131, 196); position: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>8. Tester class</h3><pre style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin-bottom: 16px; font-stretch: normal; line-height: 1.45; padding: 16px; border-radius: 3px; word-wrap: normal; background-color: rgb(247, 247, 247);\">		<code style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin: 0px; border-radius: 3px; word-break: normal; white-space: pre; border: 0px; display: inline; max-width: initial; overflow: initial; line-height: inherit; word-wrap: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">package com.prapps.tutorial.guice;\r\n\r\nimport java.util.Collection;\r\n\r\nimport org.junit.Before;\r\nimport org.junit.Test;\r\n\r\nimport com.google.inject.Guice;\r\nimport com.google.inject.Injector;\r\nimport com.prapps.tutorial.guice.ioc.EmployeeAppInjector;\r\nimport com.prapps.tutorial.guice.service.api.EmployeeService;\r\nimport com.prapps.tutorial.guice.vo.Employee;\r\n\r\npublic class Tester {\r\n\r\n    private EmployeeService employeeService; \r\n\r\n    @Before public void setUp() {\r\n        Injector injector = Guice.createInjector(new EmployeeAppInjector());        \r\n        employeeService = injector.getInstance(EmployeeService.class);\r\n    }\r\n\r\n    @Test\r\n    public void testAddEmployee() {\r\n        Employee employee = new Employee();\r\n        employee.setId(101l);\r\n        employee.setName(\"Souvik Majumder\");\r\n        employee.setSalary(1234.0d);\r\n        employeeService.addEmployee(employee);\r\n\r\n        employee = new Employee();\r\n        employee.setId(102l);\r\n        employee.setName(\"Pratik Sengupta\");\r\n        employee.setSalary(4321.0d);\r\n        employeeService.addEmployee(employee);\r\n\r\n        employee = new Employee();\r\n        employee.setId(103l);\r\n        employee.setName(\"Debojit Chatterjee\");\r\n        employee.setSalary(8675.0d);\r\n        employeeService.addEmployee(employee);\r\n    }\r\n\r\n    @Test\r\n    public void testSearchEmployee() {\r\n        testAddEmployee();\r\n\r\n        Employee employee = employeeService.searchEmployeeById(101l);\r\n        assert(\"Souvik Majumder\".equals(employee.getName()));\r\n        assert(1234d == employee.getSalary());\r\n    }\r\n\r\n    @Test\r\n    public void testSearchEmployeeByName() {\r\n        testAddEmployee();\r\n\r\n        Collection&lt;Employee&gt; employees = employeeService.searchEmployeeByName(\"Pratik Sengupta\");\r\n        assert(1 == employees.size());\r\n\r\n        Employee employee = employees.iterator().next();\r\n        assert(\"Pratik Sengupta\".equals(employee.getName()));\r\n        assert(4321d == employee.getSalary());\r\n    }\r\n}\r\n</code>\r\n	</pre><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-6-log4jxml\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/google-guice.html#6-log4jxml\" aria-hidden=\"true\" style=\"color: rgb(65, 131, 196); position: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>6. Log4j.xml</h3><pre style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin-bottom: 16px; font-stretch: normal; line-height: 1.45; padding: 16px; border-radius: 3px; word-wrap: normal; background-color: rgb(247, 247, 247);\">		<code style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin: 0px; border-radius: 3px; word-break: normal; white-space: pre; border: 0px; display: inline; max-width: initial; overflow: initial; line-height: inherit; word-wrap: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">&lt;?xml version=\"1.0\" encoding=\"UTF-8\" ?&gt;\r\n&lt;!DOCTYPE log4j:configuration SYSTEM \"log4j.dtd\"&gt;\r\n&lt;log4j:configuration debug=\"true\"\r\n                     xmlns:log4j=\'http://jakarta.apache.org/log4j/\'&gt;\r\n\r\n   &lt;appender name=\"consoleAppender\" class=\"org.apache.log4j.ConsoleAppender\"&gt;\r\n      &lt;layout class=\"org.apache.log4j.PatternLayout\"&gt;\r\n         &lt;param name=\"ConversionPattern\" value=\"%d{dd MMM yyyy HH:mm:ss} %5p %c{1} - %m%n\"/&gt;\r\n      &lt;/layout&gt;\r\n   &lt;/appender&gt;\r\n\r\n   &lt;appender name=\"fileAppender\" class=\"org.apache.log4j.RollingFileAppender\"&gt;\r\n      &lt;param name=\"append\" value=\"false\"/&gt;\r\n      &lt;param name=\"file\" value=\"out/learning.log\"/&gt;\r\n      &lt;layout class=\"org.apache.log4j.PatternLayout\"&gt;\r\n         &lt;param name=\"ConversionPattern\" value=\"%d{ABSOLUTE} %-5p [%c{1}] %m%n\"/&gt;\r\n      &lt;/layout&gt;\r\n   &lt;/appender&gt;\r\n\r\n    &lt;logger name=\"com.prapps.tutorial\" additivity=\"false\"&gt;  \r\n        &lt;level value=\"trace\" /&gt;\r\n        &lt;appender-ref ref=\"consoleAppender\" /&gt;\r\n    &lt;/logger&gt; \r\n\r\n   &lt;root&gt;\r\n      &lt;level value=\"INFO\"/&gt;\r\n      &lt;appender-ref ref=\"consoleAppender\"/&gt;\r\n      &lt;appender-ref ref=\"fileAppender\"/&gt;\r\n   &lt;/root&gt;\r\n\r\n&lt;/log4j:configuration&gt;\r\n</code>\r\n	</pre><span style=\"font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">Source Code Available at github:</span><ul style=\"padding: 0px 0px 0px 2em; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px; margin-bottom: 0px !important;\"><li>git clone url -&nbsp;<input id=\"gitCloneUrl\" type=\"text\" value=\"https://github.com/pratik006/tutorials.git\" style=\"color: rgb(51, 51, 51); font-style: normal; font-variant: normal; font-weight: normal; font-stretch: normal; font-size: 13px; line-height: 1.4; font-family: Helvetica, arial, freesans, clean, sans-serif, \'Segoe UI Emoji\', \'Segoe UI Symbol\'; margin-bottom: 0px; min-height: 34px; padding: 7px 8px; vertical-align: middle; border: 1px solid rgb(204, 204, 204); border-radius: 3px; outline: none; box-shadow: rgba(0, 0, 0, 0.0745098) 0px 1px 2px inset; width: 250px; background-position: 100% 50%; background-repeat: no-repeat;\"></li><li><a href=\"https://github.com/pratik006/tutorials\" style=\"color: rgb(65, 131, 196); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Download Page</a></li><li><a href=\"https://github.com/pratik006/tutorials/tree/master/google-guice\" style=\"color: rgb(65, 131, 196); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Browse</a></li></ul>','COMPLETE','google guice, java'),(13,'google-guice-jpa','','2015-12-06 00:52:36','Pratik Sengupta','Google Guice with JPA configuration','2017-01-14 02:12:15','Pratik Sengupta',NULL,NULL,'<p style=\"margin-bottom: 16px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">The following sections will get you started with the basic configuration of google-guice with JPA with a complete working example. The source code can be downloaded as well. This is intended for a beginner not for an advanced user.</p><hr style=\"height: 4px; margin: 16px 0px; overflow: hidden; border-top-width: 0px; border-style: none; padding: 0px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px; background: rgb(231, 231, 231);\"><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-1-add-dependencies\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/google-guice-jpa.html#1-add-dependencies\" aria-hidden=\"true\" style=\"color: rgb(65, 131, 196); position: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>1. Add dependencies</h3><hr style=\"height: 4px; margin: 16px 0px; overflow: hidden; border-top-width: 0px; border-style: none; padding: 0px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px