osition: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>2. Create the project structure</h3><p style=\"margin-bottom: 16px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\"><img src=\"http://apps-pratiks.rhcloud.com/resources/images/tutorials/project_structure-google-guice.png\" alt=\"project structure\" style=\"max-width: 100%;\"></p><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-3-create-the-vo-class\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/google-guice-jpa.html#3-create-the-vo-class\" aria-hidden=\"true\" style=\"color: rgb(65, 131, 196); position: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>3. Create the VO class</h3><pre style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin-bottom: 16px; font-stretch: normal; line-height: 1.45; padding: 16px; border-radius: 3px; word-wrap: normal; background-color: rgb(247, 247, 247);\"><code style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin: 0px; border-radius: 3px; word-break: normal; white-space: pre; border: 0px; display: inline; max-width: initial; overflow: initial; line-height: inherit; word-wrap: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">package com.prapps.tutorial.guice.vo;\r\n\r\npublic class Employee {\r\n\r\n    private long id;\r\n    private String name;\r\n    private double salary;\r\n\r\n    public long getId() {\r\n        return id;\r\n    }\r\n    public void setId(long id) {\r\n        this.id = id;\r\n    }\r\n    public String getName() {\r\n        return name;\r\n    }\r\n    public void setName(String name) {\r\n        this.name = name;\r\n    }\r\n    public double getSalary() {\r\n        return salary;\r\n    }\r\n    public void setSalary(double salary) {\r\n        this.salary = salary;\r\n    }\r\n}\r\n</code></pre><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-4-create-the-entity\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/google-guice-jpa.html#4-create-the-entity\" aria-hidden=\"true\" style=\"color: rgb(65, 131, 196); position: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>4. Create the Entity</h3><pre style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin-bottom: 16px; font-stretch: normal; line-height: 1.45; padding: 16px; border-radius: 3px; word-wrap: normal; background-color: rgb(247, 247, 247);\"><code style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin: 0px; border-radius: 3px; word-break: normal; white-space: pre; border: 0px; display: inline; max-width: initial; overflow: initial; line-height: inherit; word-wrap: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">package com.prapps.tutorial.guice.entities;\r\n\r\nimport javax.persistence.Column;\r\nimport javax.persistence.Entity;\r\nimport javax.persistence.Id;\r\nimport javax.persistence.Table;\r\n\r\n@Entity\r\n@Table(name=\"EMPLOYEE\")\r\npublic class Employee {\r\n\r\n    @Id\r\n    @Column(name=\"ID\")\r\n    private long id;\r\n    @Column(name=\"NAME\")\r\n    private String name;\r\n    @Column(name=\"SALARY\")\r\n    private double salary;\r\n\r\n    public Employee() {\r\n        // TODO Auto-generated constructor stub\r\n    }\r\n\r\n    public Employee(long id, String name, double salary) {\r\n        this.id = id;\r\n        this.name = name;\r\n        this.salary = salary;\r\n    }\r\n\r\n    public long getId() {\r\n        return id;\r\n    }\r\n    public void setId(long id) {\r\n        this.id = id;\r\n    }\r\n    public String getName() {\r\n        return name;\r\n    }\r\n    public void setName(String name) {\r\n        this.name = name;\r\n    }\r\n    public double getSalary() {\r\n        return salary;\r\n    }\r\n    public void setSalary(double salary) {\r\n        this.salary = salary;\r\n    }\r\n    @Override\r\n    public String toString() {\r\n        return \"Employee [id=\" + id + \", name=\" + name + \", salary=\" + salary + \"]\";\r\n    }\r\n\r\n}\r\n</code></pre><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-5-add-the-service-interface\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/google-guice-jpa.html#5-add-the-service-interface\" aria-hidden=\"true\" style=\"color: rgb(65, 131, 196); position: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>5. Add the Service Interface</h3><pre style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin-bottom: 16px; font-stretch: normal; line-height: 1.45; padding: 16px; border-radius: 3px; word-wrap: normal; background-color: rgb(247, 247, 247);\"><code style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin: 0px; border-radius: 3px; word-break: normal; white-space: pre; border: 0px; display: inline; max-width: initial; overflow: initial; line-height: inherit; word-wrap: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">package com.prapps.tutorial.guice.service.api;\r\n\r\nimport java.util.Collection;\r\n\r\nimport com.prapps.tutorial.guice.vo.Employee;\r\n\r\npublic interface EmployeeService {\r\n\r\n    void addEmployee(Employee employee);\r\n\r\n    Collection&lt;Employee&gt; searchEmployeeByName(String name);\r\n\r\n    Employee searchEmployeeById(Long id);\r\n}\r\n</code></pre><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-6-add-the-dao-interface\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/google-guice-jpa.html#6-add-the-dao-interface\" aria-hidden=\"true\" style=\"color: rgb(65, 131, 196); position: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>6. Add the DAO Interface</h3><pre style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin-bottom: 16px; font-stretch: normal; line-height: 1.45; padding: 16px; border-radius: 3px; word-wrap: normal; background-color: rgb(247, 247, 247);\"><code style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin: 0px; border-radius: 3px; word-break: normal; white-space: pre; border: 0px; display: inline; max-width: initial; overflow: initial; line-height: inherit; word-wrap: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">package com.prapps.tutorial.guice.dao.api;\r\n\r\nimport java.util.List;\r\n\r\nimport com.prapps.tutorial.guice.entities.Employee;\r\n\r\npublic interface EmployeeDao {\r\n\r\n    void save(Employee employee);\r\n    Employee findEmployeeById(long id);\r\n    List&lt;Employee&gt; findEmployee(String name);\r\n}\r\n</code></pre><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-7-service-implementation\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/google-guice-jpa.html#7-service-implementation\" aria-hidden=\"true\" style=\"color: rgb(65, 131, 196); position: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>7. Service Implementation</h3><pre style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin-bottom: 16px; font-stretch: normal; line-height: 1.45; padding: 16px; border-radius: 3px; word-wrap: normal; background-color: rgb(247, 247, 247);\"><code style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin: 0px; border-radius: 3px; word-break: normal; white-space: pre; border: 0px; display: inline; max-width: initial; overflow: initial; line-height: inherit; word-wrap: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">package com.prapps.tutorial.guice.service.impl;\r\n\r\nimport java.util.ArrayList;\r\nimport java.util.Collection;\r\nimport java.util.List;\r\n\r\nimport com.google.inject.Inject;\r\nimport com.google.inject.persist.Transactional;\r\nimport com.prapps.tutorial.guice.dao.api.EmployeeDao;\r\nimport com.prapps.tutorial.guice.service.api.EmployeeService;\r\nimport com.prapps.tutorial.guice.vo.Employee;\r\n\r\npublic class EmployeeServiceImpl implements EmployeeService {\r\n\r\n    @Inject private EmployeeDao employeeDao;\r\n\r\n    @Transactional\r\n    public void addEmployee(Employee employee) {\r\n        com.prapps.tutorial.guice.entities.Employee emp = new com.prapps.tutorial.guice.entities.Employee(\r\n                employee.getId(),\r\n                employee.getName(),\r\n                employee.getSalary()\r\n                );\r\n        employeeDao.save(emp);\r\n    }\r\n\r\n    public Collection&lt;Employee&gt; searchEmployeeByName(String name) {\r\n        Collection&lt;Employee&gt; result = new ArrayList&lt;Employee&gt;();\r\n        List&lt;com.prapps.tutorial.guice.entities.Employee&gt; employees = employeeDao.findEmployee(name);\r\n        for(com.prapps.tutorial.guice.entities.Employee emp : employees) {\r\n            result.add(new Employee(emp.getId(), emp.getName(), emp.getSalary()));\r\n        }\r\n        return result;\r\n    }\r\n\r\n    public Employee searchEmployeeById(Long id) {\r\n        com.prapps.tutorial.guice.entities.Employee employee = employeeDao.findEmployeeById(id);\r\n        Employee empvo = new Employee();\r\n        empvo.setId(employee.getId());\r\n        empvo.setName(employee.getName());\r\n        empvo.setSalary(employee.getSalary());\r\n        return empvo;\r\n    }\r\n\r\n}\r\n</code></pre><p style=\"margin-bottom: 16px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">It is important to note that the method&nbsp;<strong>addEmployee</strong>&nbsp;is annotated with&nbsp;<strong>com.google.inject.persist.Transactional</strong>.</p><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-8-dao-implementation\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/google-guice-jpa.html#8-dao-implementation\" aria-hidden=\"true\" style=\"color: rgb(65, 131, 196); position: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>8. DAO Implementation</h3><p style=\"margin-bottom: 16px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">Note: When the DAO class is singleton the entityManager Provider should be used instead of directly injecting the entityManager by @inject EntityManager entityManager as in the later approach every invocation will be a new transaction.</p><pre style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin-bottom: 16px; font-stretch: normal; line-height: 1.45; padding: 16px; border-radius: 3px; word-wrap: normal; background-color: rgb(247, 247, 247);\"><code style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin: 0px; border-radius: 3px; word-break: normal; white-space: pre; border: 0px; display: inline; max-width: initial; overflow: initial; line-height: inherit; word-wrap: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">package com.prapps.tutorial.guice.dao.impl;\r\n\r\nimport java.util.List;\r\n\r\nimport javax.persistence.EntityManager;\r\nimport javax.persistence.criteria.CriteriaQuery;\r\nimport javax.persistence.criteria.Root;\r\n\r\nimport org.hibernate.Session;\r\n\r\nimport com.google.inject.Inject;\r\nimport com.google.inject.Provider;\r\nimport com.prapps.tutorial.guice.dao.api.EmployeeDao;\r\nimport com.prapps.tutorial.guice.entities.Employee;\r\n\r\npublic class EmployeeDaoImpl implements EmployeeDao {\r\n\r\n    @Inject private Provider&lt;EntityManager&gt; emp;\r\n\r\n    private Session getSession() {\r\n        return emp.get().unwrap(Session.class);\r\n    }\r\n\r\n    public Employee findEmployeeById(long id) {\r\n        return emp.get().find(Employee.class, id);\r\n    }\r\n\r\n    public List&lt;Employee&gt; findEmployee(String name) {\r\n        /*Criteria criteria = getSession().createCriteria(Employee.class);\r\n        criteria.add(Restrictions.eq(\"name\", name));\r\n        return (List&lt;Employee&gt;) criteria.list();*/\r\n        CriteriaQuery&lt;Employee&gt; createQuery = emp.get().getCriteriaBuilder().createQuery(Employee.class);\r\n        Root&lt;Employee&gt; root = createQuery.from(Employee.class);\r\n        createQuery.where(root.get(\"name\").in(name));\r\n        return emp.get().createQuery(createQuery).getResultList();\r\n    }\r\n\r\n    public void save(Employee employee) {\r\n        emp.get().merge(employee);\r\n    }\r\n}\r\n</code></pre><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-9-persistencexml\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/google-guice-jpa.html#9-persistencexml\" aria-hidden=\"true\" style=\"color: rgb(65, 131, 196); position: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>9. persistence.xml</h3><p style=\"margin-bottom: 16px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">A simple database configuration with H2 database. Note the persistent-unit name should match while installing the JPAPersistModule in the next section.</p><div class=\"highlight highlight-xml\" style=\"margin-bottom: 16px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\"><pre style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin-bottom: 0px; font-stretch: normal; line-height: 1.45; padding: 16px; border-radius: 3px; word-wrap: normal; word-break: normal; background-color: rgb(247, 247, 247);\">&lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">persistence</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">xmlns</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>http://java.sun.com/xml/ns/persistence<span class=\"pl-pds\">\"</span></span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">xmlns</span><span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">:</span><span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">xsi</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>http://www.w3.org/2001/XMLSchema-instance<span class=\"pl-pds\">\"</span></span>\r\n    <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">xsi</span><span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">:</span><span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">schemaLocation</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>http://java.sun.com/xml/ns/persistence http://java.sun.com/xml/ns/persistence/persistence_2_0.xsd<span class=\"pl-pds\">\"</span></span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">version</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>2.0<span class=\"pl-pds\">\"</span></span>&gt;\r\n    &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">persistence-unit</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">name</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>employee-persister<span class=\"pl-pds\">\"</span></span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">transaction-type</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>RESOURCE_LOCAL<span class=\"pl-pds\">\"</span></span>&gt;\r\n        &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">provider</span>&gt;org.hibernate.ejb.HibernatePersistence&lt;/<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">provider</span>&gt;\r\n\r\n        &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">class</span>&gt;com.prapps.tutorial.guice.entities.Employee&lt;/<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">class</span>&gt;\r\n\r\n        &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">properties</span>&gt;\r\n            &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">property</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">name</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>javax.persistence.jdbc.driver<span class=\"pl-pds\">\"</span></span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">value</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>org.h2.Driver<span class=\"pl-pds\">\"</span></span> /&gt;\r\n            &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">property</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">name</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>javax.persistence.jdbc.url<span class=\"pl-pds\">\"</span></span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">value</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>jdbc:h2:mem:test<span class=\"pl-pds\">\"</span></span> /&gt;\r\n            &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">property</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">name</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>javax.persistence.jdbc.user<span class=\"pl-pds\">\"</span></span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">value</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>sa<span class=\"pl-pds\">\"</span></span> /&gt;\r\n            &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">property</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">name</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>javax.persistence.jdbc.password<span class=\"pl-pds\">\"</span></span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">value</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span><span class=\"pl-pds\">\"</span></span> /&gt;\r\n            &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">property</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">name</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>hibernate.dialect<span class=\"pl-pds\">\"</span></span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">value</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>org.hibernate.dialect.H2Dialect<span class=\"pl-pds\">\"</span></span> /&gt;\r\n            &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">property</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">name</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>hibernate.hbm2ddl.auto<span class=\"pl-pds\">\"</span></span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">value</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>create-drop<span class=\"pl-pds\">\"</span></span> /&gt;\r\n            &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">property</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">name</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>show_sql<span class=\"pl-pds\">\"</span></span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">value</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>true<span class=\"pl-pds\">\"</span></span> /&gt;\r\n            &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">property</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">name</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>hibernate.show_sql<span class=\"pl-pds\">\"</span></span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">value</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>true<span class=\"pl-pds\">\"</span></span> /&gt;\r\n            &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">property</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">name</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>hibernate.temp.use_jdbc_metadata_defaults<span class=\"pl-pds\">\"</span></span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">value</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>false<span class=\"pl-pds\">\"</span></span> /&gt;\r\n        &lt;/<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">properties</span>&gt;\r\n    &lt;/<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">persistence-unit</span>&gt;\r\n&lt;/<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">persistence</span>&gt;</pre></div><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-10-start-the-persistence-service\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/google-guice-jpa.html#10-start-the-persistence-service\" aria-hidden=\"true\" style=\"color: rgb(65, 131, 196); position: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>10. Start the Persistence Service</h3><p style=\"margin-bottom: 16px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">This class starts the persistence service otherwise it will throw a Null PointerException while accessing database. This can be further configured based on needs.</p><pre style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin-bottom: 16px; font-stretch: normal; line-height: 1.45; padding: 16px; border-radius: 3px; word-wrap: normal; background-color: rgb(247, 247, 247);\"><code style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin: 0px; border-radius: 3px; word-break: normal; white-space: pre; border: 0px; display: inline; max-width: initial; overflow: initial; line-height: inherit; word-wrap: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">package com.prapps.tutorial.guice.ioc;\r\n\r\nimport com.google.inject.Inject;\r\nimport com.google.inject.Singleton;\r\nimport com.google.inject.persist.PersistService;\r\n\r\n@Singleton\r\npublic class PersistenceInitializer {\r\n\r\n    @Inject\r\n    PersistenceInitializer(PersistService service) {\r\n        service.start();\r\n        // At this point JPA is started and ready.\r\n    }\r\n}\r\n</code></pre><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-11-guice-configuration\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/google-guice-jpa.html#11-guice-configuration\" aria-hidden=\"true\" style=\"color: rgb(65, 131, 196); position: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>11. Guice configuration</h3><pre style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin-bottom: 16px; font-stretch: normal; line-height: 1.45; padding: 16px; border-radius: 3px; word-wrap: normal; background-color: rgb(247, 247, 247);\"><code style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin: 0px; border-radius: 3px; word-break: normal; white-space: pre; border: 0px; display: inline; max-width: initial; overflow: initial; line-height: inherit; word-wrap: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">package com.prapps.tutorial.guice.ioc;\r\n\r\nimport com.google.inject.AbstractModule;\r\nimport com.google.inject.Singleton;\r\nimport com.google.inject.matcher.Matchers;\r\nimport com.google.inject.persist.jpa.JpaPersistModule;\r\nimport com.prapps.tutorial.guice.aop.LogAspect;\r\nimport com.prapps.tutorial.guice.dao.api.EmployeeDao;\r\nimport com.prapps.tutorial.guice.dao.impl.EmployeeDaoImpl;\r\nimport com.prapps.tutorial.guice.service.api.EmployeeService;\r\nimport com.prapps.tutorial.guice.service.impl.EmployeeServiceImpl;\r\n\r\npublic class EmployeeAppInjector extends AbstractModule {\r\n\r\n    @Override\r\n    protected void configure() {\r\n        // \"employee-persister\" is defined in the persistence.xml\r\n        install(new JpaPersistModule(\"employee-persister\"));\r\n        bind(EmployeeService.class).to(EmployeeServiceImpl.class).in(Singleton.class);\r\n        bind(EmployeeDao.class).to(EmployeeDaoImpl.class).in(Singleton.class);\r\n        LogAspect logAspect = new LogAspect();\r\n        requestInjection(logAspect);\r\n        bindInterceptor(Matchers.subclassesOf(EmployeeService.class), Matchers.any(), logAspect);\r\n        bind(PersistenceInitializer.class);\r\n    }\r\n}\r\n</code></pre><p style=\"margin-bottom: 16px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">For deploying in web environments&nbsp;<code style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; padding: 0.2em 0px; margin: 0px; border-radius: 3px; background-color: rgba(0, 0, 0, 0.0392157);\">filter(\"/*\").through(PersistFilter.class);</code>&nbsp;should be used and PersistenceInitializer is not required.</p><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-12-test-client---add-the-client-to-test-the-configuration\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/google-guice-jpa.html#12-test-client---add-the-client-to-test-the-configuration\" aria-hidden=\"true\" style=\"color: rgb(65, 131, 196); position: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>12. Test Client - Add the client to test the configuration</h3><pre style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin-bottom: 16px; font-stretch: normal; line-height: 1.45; padding: 16px; border-radius: 3px; word-wrap: normal; background-color: rgb(247, 247, 247);\"><code style=\"font-family: Consolas, \'Liberation Mono\', Menlo, Courier, monospace; font-size: 13.6px; margin: 0px; border-radius: 3px; word-break: normal; white-space: pre; border: 0px; display: inline; max-width: initial; overflow: initial; line-height: inherit; word-wrap: normal; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">package com.prapps.tutorial.guice;\r\n\r\nimport java.util.Collection;\r\n\r\nimport org.apache.log4j.Logger;\r\nimport org.junit.Before;\r\nimport org.junit.Test;\r\n\r\nimport com.google.inject.Guice;\r\nimport com.google.inject.Injector;\r\nimport com.prapps.tutorial.guice.ioc.EmployeeAppInjector;\r\nimport com.prapps.tutorial.guice.ioc.PersistenceInitializer;\r\nimport com.prapps.tutorial.guice.service.api.EmployeeService;\r\nimport com.prapps.tutorial.guice.vo.Employee;\r\n\r\npublic class GuiceTestClient {\r\n\r\n    private static final Logger LOG = Logger.getLogger(GuiceTestClient.class);\r\n    private EmployeeService employeeService; \r\n\r\n    @Before public void setUp() {\r\n        Injector injector = Guice.createInjector(new EmployeeAppInjector());\r\n        //To start the jpa service add the following line        \r\n        PersistenceInitializer ps = injector.getInstance(PersistenceInitializer.class);\r\n        employeeService = injector.getInstance(EmployeeService.class);\r\n    }\r\n\r\n    @Test\r\n    public void testAddEmployee() {\r\n        Employee employee = new Employee();\r\n        employee.setId(101l);\r\n        employee.setName(\"Souvik Majumder\");\r\n        employee.setSalary(1234.0d);\r\n        employeeService.addEmployee(employee);\r\n\r\n        employee = new Employee();\r\n        employee.setId(102l);\r\n        employee.setName(\"Pratik Sengupta\");\r\n        employee.setSalary(4321.0d);\r\n        employeeService.addEmployee(employee);\r\n\r\n        employee = new Employee();\r\n        employee.setId(103l);\r\n        employee.setName(\"Debojit Chatterjee\");\r\n        employee.setSalary(8675.0d);\r\n        employeeService.addEmployee(employee);\r\n    }\r\n\r\n    @Test\r\n    public void testSearchEmployee() {\r\n        testAddEmployee();\r\n\r\n        Employee employee = employeeService.searchEmployeeById(101l);\r\n        assert(\"Souvik Majumder\".equals(employee.getName()));\r\n        assert(1234d == employee.getSalary());\r\n    }\r\n\r\n    @Test\r\n    public void testSearchEmployeeByName() {\r\n        testAddEmployee();\r\n\r\n        Collection&lt;Employee&gt; employees = employeeService.searchEmployeeByName(\"Pratik Sengupta\");\r\n        assert(1 == employees.size());\r\n\r\n        Employee employee = employees.iterator().next();\r\n        assert(\"Pratik Sengupta\".equals(employee.getName()));\r\n        assert(4321d == employee.getSalary());\r\n        LOG.debug(employee);\r\n    }\r\n}\r\n</code></pre><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-13-log4jxml\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/google-guice-jpa.html#13-log4jxml\" aria-hidden=\"true\" style=\"color: rgb(