class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">name</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>fileAppender<span class=\"pl-pds\">\"</span></span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">class</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>org.apache.log4j.RollingFileAppender<span class=\"pl-pds\">\"</span></span>&gt;\r\n      &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">param</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">name</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>append<span class=\"pl-pds\">\"</span></span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">value</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>false<span class=\"pl-pds\">\"</span></span>/&gt;\r\n      &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">param</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">name</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>file<span class=\"pl-pds\">\"</span></span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">value</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>out/learning.log<span class=\"pl-pds\">\"</span></span>/&gt;\r\n      &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">layout</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">class</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>org.apache.log4j.PatternLayout<span class=\"pl-pds\">\"</span></span>&gt;\r\n         &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">param</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">name</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>ConversionPattern<span class=\"pl-pds\">\"</span></span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">value</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>%d{ABSOLUTE} %-5p [%c{1}] %m%n<span class=\"pl-pds\">\"</span></span>/&gt;\r\n      &lt;/<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">layout</span>&gt;\r\n   &lt;/<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">appender</span>&gt;\r\n\r\n    &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">logger</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">name</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>org.hibernate<span class=\"pl-pds\">\"</span></span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">additivity</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>false<span class=\"pl-pds\">\"</span></span>&gt;  \r\n        &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">level</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">value</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>trace<span class=\"pl-pds\">\"</span></span> /&gt;\r\n        &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">appender-ref</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">ref</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>consoleAppender<span class=\"pl-pds\">\"</span></span> /&gt;\r\n    &lt;/<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">logger</span>&gt; \r\n\r\n    &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">logger</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">name</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>com.prapps.tutorial<span class=\"pl-pds\">\"</span></span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">additivity</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>false<span class=\"pl-pds\">\"</span></span>&gt;  \r\n        &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">level</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">value</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>trace<span class=\"pl-pds\">\"</span></span> /&gt;\r\n        &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">appender-ref</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">ref</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>consoleAppender<span class=\"pl-pds\">\"</span></span> /&gt;\r\n    &lt;/<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">logger</span>&gt;\r\n\r\n   &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">root</span>&gt;\r\n      &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">level</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">value</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>INFO<span class=\"pl-pds\">\"</span></span>/&gt;\r\n      &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">appender-ref</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">ref</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>consoleAppender<span class=\"pl-pds\">\"</span></span>/&gt;\r\n      &lt;<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">appender-ref</span> <span class=\"pl-e\" style=\"color: rgb(121, 93, 163);\">ref</span>=<span class=\"pl-s1\" style=\"color: rgb(223, 80, 0);\"><span class=\"pl-pds\">\"</span>fileAppender<span class=\"pl-pds\">\"</span></span>/&gt;\r\n   &lt;/<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">root</span>&gt;\r\n\r\n&lt;/<span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">log4j</span><span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">:</span><span class=\"pl-ent\" style=\"color: rgb(99, 163, 92);\">configuration</span>&gt;</pre></div><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\"><a id=\"user-content-conclusion\" class=\"anchor\" href=\"http://apps-pratiks.rhcloud.com/static/tutorials/google-guice-jpa.html#conclusion\" aria-hidden=\"true\" style=\"color: rgb(65, 131, 196); position: absolute; top: 0px; bottom: 0px; left: 0px; display: block; padding-right: 6px; padding-left: 30px; margin-left: -30px; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\"></a>Conclusion</h3><p style=\"margin-bottom: 16px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">Point to keep in mind is to start the PersistenceService when using in local environment. For further info please visit&nbsp;<a href=\"https://github.com/google/guice/wiki/JPA\" style=\"color: rgb(65, 131, 196); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">https://github.com/google/guice/wiki/JPA</a>&nbsp;and to learn about transactional strategies refer to<a href=\"https://github.com/google/guice/wiki/Transactions\" style=\"color: rgb(65, 131, 196); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">https://github.com/google/guice/wiki/Transactions</a></p><span style=\"font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">Source Code for this example is available at github:</span><ul style=\"padding: 0px 0px 0px 2em; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px; margin-bottom: 0px !important;\"><li>git clone url -&nbsp;<input id=\"gitCloneUrl\" type=\"text\" value=\"https://github.com/pratik006/tutorials.git\" style=\"color: rgb(51, 51, 51); font-style: normal; font-variant: normal; font-weight: normal; font-stretch: normal; font-size: 13px; line-height: 1.4; font-family: Helvetica, arial, freesans, clean, sans-serif, \'Segoe UI Emoji\', \'Segoe UI Symbol\'; margin-bottom: 0px; min-height: 34px; padding: 7px 8px; vertical-align: middle; border: 1px solid rgb(204, 204, 204); border-radius: 3px; outline: none; box-shadow: rgba(0, 0, 0, 0.0745098) 0px 1px 2px inset; width: 250px; background-position: 100% 50%; background-repeat: no-repeat;\"></li><li><a href=\"https://github.com/pratik006/tutorials\" style=\"color: rgb(65, 131, 196); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Download Page</a></li><li><a href=\"https://github.com/pratik006/tutorials/tree/master/google-guice-jpa\" style=\"color: rgb(65, 131, 196); background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Browse</a></li></ul>','COMPLETE','google-guice, jpa, java'),(14,'mulpokhri','https://lh4.googleusercontent.com/-yCAp4_l9s-g/VLzqg9btfTI/AAAAAAAABlg/OTjJ934B1Nw/w1190-h894-no/100_8251.JPG','2015-12-06 01:04:15','Pratik Sengupta','Mesmerizing Mulpokhri - A Camping Experience to cherish','2017-01-05 13:56:01','Pratik Sengupta',NULL,NULL,'<span style=\"font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">Mul Pokhari, other than being an amazing campsite and a birder’s paradise, also is a gateway to Neora Valley National Park, the last of the few remaining bio-diversities in our country and a UNESCO World Heritage Site. This pristine forest, still largely unexplored, offers protection to more than 31 species of mammals, 250 species of birds, 276 species of insects, and, 38 species of other invertebrates. Many of these are Red Listed according to IUCN. It houses a diverse variety of floras, many of which are extremely rare.</span><div><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\">Day 1:</h3><span style=\"font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">Take a night train from Sealdah Railway station to New Jalpaiguri(NJP). There are quite a few trains but Darjeeling Mail and Padatik Express are the most preferred one. We were a group of 20 from TCS-Maitree Adventure Club.We hired tents,sleeping bags,rucksacks and matresses from</span><p style=\"margin-bottom: 16px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px; padding-left: 20px;\"><i>Ubac Adventure,&nbsp;<br>34 Mahatma Gandhi Road, Raja Ram Mohan Roy Sarani, Near Purobi Cinema Hall,&nbsp;<br>Kolkata - 700009. Contact No-09038278434.</i></p><span style=\"font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">Our train, Darjeeling Mail departed from Sealdah on its scheduled time at 10:30 pm.</span><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\">Day 2:</h3><span style=\"font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">We arrived NJP by 8:00 am in the morning.</span><div class=\"travelImg\" style=\"width: 500px; text-align: center; font-style: italic; padding-top: 10px; padding-bottom: 10px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 12px !important;\"><img alt=\"Mt. Khangchendzonga from NJP Rly Stn\" src=\"https://lh3.googleusercontent.com/-QpfAiFkyNLg/VLzzJxACg7I/AAAAAAAABp0/vKq4Ld6JKHo/w1190-h894-no/100_8222.JPG\" style=\"max-width: 100%;\">Mt. Khangchendzonga from NJP Railway Station</div><span style=\"font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">We had booked a Swaraj Majda which took us to Aritar. On our way we had brunch at Geilkhola along the bank of river Teesta. Most of us enjoyed the freshly steamed Chicken Momos with chilly garlic local made sauce, which awakens my taste buds as I write ! One can enjoy the scenic beauty of river Teesta in Pista color. Locals say that this greenish tinge in the river reflects a clear weather in the mountains. After downpoures the water turns muddy as an aftereffect within 2 days.</span><div class=\"travelImg\" style=\"width: 500px; text-align: center; font-style: italic; padding-top: 10px; padding-bottom: 10px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 12px !important;\"><img alt=\"\" src=\"https://lh3.googleusercontent.com/wSnOIZjlsIv-G_C04ztlZWSBQbml47obyP5D-aFAQu4=w1192-h894-no\" style=\"max-width: 100%;\">River Teesta at Geilkhola</div><span style=\"font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">We ascended to Rangpo along the river Teesta, from here the route turns east towards Rhenok along the Silk Route. we reached Aritar by 3:30 pm. Here we changed for Mulkharkha village, on mahindra comander jeeps through a bumpy and boulder filled roads for which it took us around 45 minutes to reach. One can enjoy the tranquility and serenity of this place with the sun setting in the western horizon creating a golden aura.</span><div class=\"travelImg\" style=\"width: 500px; text-align: center; font-style: italic; padding-top: 10px; padding-bottom: 10px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 12px !important;\"><img alt=\"\" src=\"https://lh4.googleusercontent.com/-yCAp4_l9s-g/VLzqg9btfTI/AAAAAAAABlg/OTjJ934B1Nw/w1190-h894-no/100_8251.JPG\" style=\"max-width: 100%;\">Mulkharkha village</div><span style=\"font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">We were welcomed by Mr. Neema Sherpa and his family with tea and pakoras, who shared two of his house as homestay. We were overwhelmed by their hospitality. One must catch the glimpse of sun set at dawn though keeping in mind to return to base before darkness sets in. One must not think that the night life is boring, on contrary it was amazing. They offered us locally fermented drinks,thumba and chang and kept us entertaining with some sentilating local dances and songs. being in a group we enjoyed a lot.</span><div class=\"travelImg\" style=\"width: 500px; text-align: center; font-style: italic; padding-top: 10px; padding-bottom: 10px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 12px !important;\"><img alt=\"\" src=\"https://lh5.googleusercontent.com/-Bj3FBwoJL2U/VMAIYHsjL2I/AAAAAAAABwo/sCoVzQeiSkw/w1192-h894-no/DSCN0281.JPG\" style=\"max-width: 100%;\">Our host - Neema Sherpa (at the center)</div><span style=\"font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">our dinner was sumptuous filled with local delicacies consisting of nearby 12 items. All this they do much of to their happiness not as a means of livelihood.We were not at ease with the bone chilling weather except our captain-cum-coordinator,Nilanjanda for whom it was just another day at home. The homestay was a nice experience as the house provided was neat and clean with blankets and quilts. The washroom was common yet well maintained and with ample amount of water. Most of us had a sound sleep.</span><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\">Day 3:</h3><span style=\"font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">Witnessing the golden rays illuminating the peak of kanchenjunga was itself a memory.</span><div class=\"travelImg\" style=\"width: 500px; text-align: center; font-style: italic; padding-top: 10px; padding-bottom: 10px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 12px !important;\"><img alt=\"\" src=\"https://lh5.googleusercontent.com/aGib574rbZIJ1kfsrP6CYTQztu8-DYZ80bJSdi0lVb0=w1192-h894-no\" style=\"max-width: 100%;\">Mt. Khangchendzonga (Zoomed)</div><div class=\"travelImg\" style=\"width: 500px; text-align: center; font-style: italic; padding-top: 10px; padding-bottom: 10px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 12px !important;\"><img alt=\"\" src=\"https://lh5.googleusercontent.com/ZcYqVI59PQdBEuXE3OclsU4U5bKOmircPAGj66dDpmY=w1192-h894-no\" style=\"max-width: 100%;\">Mt. Khangchendzonga</div><span style=\"font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">We went to another point from where one can relish the raw beauty of kanchenjunga clearly. We had our breakfast and proceded for mulpokhari,the camping site for the day. At 10:00 am we started our trekking !, We were required to carry drinking water. On the way we witnessed many pictursque views and reached our destination mulpokhari, famous for the wishing lake, within 2 hours. We were unable to witness the reflection of kanchenjunga on the lake as it was covered with clouds but luckily we made it the next day. We pitched our tents for the first time with the initial instruction from our coordinator Nilanjan.</span><div class=\"travelImg\" style=\"width: 500px; text-align: center; font-style: italic; padding-top: 10px; padding-bottom: 10px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 12px !important;\"><img alt=\"\" src=\"https://lh3.googleusercontent.com/-nfCDDmix4tg/VMPmOdYO-jI/AAAAAAAAB-g/exMKTo-jrQc/w1273-h848-no/Nilanjan.jpg\" style=\"max-width: 100%;\">Captain cum Mentor - Nilanjan Lahiri</div><div class=\"travelImg\" style=\"width: 500px; text-align: center; font-style: italic; padding-top: 10px; padding-bottom: 10px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 12px !important;\"><img alt=\"\" src=\"https://lh6.googleusercontent.com/-vQcFI-yTuUc/VMAPV_6djmI/AAAAAAAABzI/6dj9e6qwHkM/w1192-h894-no/DSCN0453.JPG\" style=\"max-width: 100%;\">Practical lesson on Tent Pitching</div><span style=\"font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">As soon as we were finished with our tent pitching it started drizzling which later turned into snowfall. After having our lunch prepared their only we made it to our shelter and soon the weather cleared. After this we decided to experience and explore the wilderness of Neora Valley National Park,it is also known as birders\' paradise,with our guide. It is the land of the elegant red pandas and rich diverse flaura and fauna making these park an important wilderness zone. one must rfeturn to the base camp before dusk. On the way we collected firewood for the bonfire and witnessed the awe stucking sunset. As time was passing bonfire was the only way to keep us warm against the gradually droppinng temperature. Camp lights, bonfire and torches were the only souce of light.</span><span style=\"font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">Everybody were busy starring at the sky which was flooded with stars! and SHOOTING STARS ! We had dinner under the naked sky with the temperature continously falling and went for the long waited rest.</span><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\">Day 4:</h3><span style=\"font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">Ater the sleepless night because of extreme weather conditions we were eagerly waiting for the sunrise yet some where busy snooring. When we were unzipping the tent we realised that everything was frozen from tents to surroundings even ourselves.</span><div class=\"travelImg\" style=\"width: 500px; text-align: center; font-style: italic; padding-top: 10px; padding-bottom: 10px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 12px !important;\"><img alt=\"\" src=\"https://lh3.googleusercontent.com/-mJqX63jk-Co/VL01hqQuKOI/AAAAAAAABrw/pTf-flT6Dcw/w1192-h894-no/IMG_20150118_072824.jpg\" style=\"max-width: 100%;\">morning frost</div><span style=\"font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">Around 4:30 we witnessed the shimmering beauty of the sky flooded with stars and moon! then we approached to Mulpokhri Wishing Lake to witness the mesmirizing golden rays falling on the \"Khangchendzonga Peak\". The gradual change in the color of the mighty Khangchendzonga from white to orange to white was indeed worth watching. Then we packed our luggages including our tents and started descending to Mulkharkha village. By this time the frost started melting making the mountain slopes very slippery. But luckily it dried off very soon. We reached Mulkharkha Village and were served with the breakfast.</span><div class=\"travelImg\" style=\"width: 500px; text-align: center; font-style: italic; padding-top: 10px; padding-bottom: 10px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 12px !important;\"><img alt=\"\" src=\"https://lh4.googleusercontent.com/-O1eJSqtsWec/VMAOivLKAcI/AAAAAAAABys/3Ha435626bM/w1192-h894-no/DSCN0374-SMILE.jpg\" style=\"max-width: 100%;\">On our return journey at Mulkharkha</div><span style=\"font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">The host bid us farewell wholeheartedly in a very tradiotional way by giving scarf and thanking us for being their guest. Though one can reach Aritar by a jeep,which is needed to be booked earlier by informing the host, we trekked down keeping the bag and buggages inside the jeep. We then boarded a bus, which was booked in advance, had lunch at Rangpo and reached NGP at 7:45 pm. We then boarded PADATIK EXPRESS which was scheduled to depart at 9:00 pm and had our dinner which came to us as a surprise by our captain, Nilanjan da while we were busy calling out all the memories.</span><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\">Day 5</h3><span style=\"font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">We reached Sealdah by 7:20 am with new relations, new bondings and new memories of the mesmirizing Mulphokri !</span><h3 style=\"margin-top: 1em; margin-bottom: 16px; line-height: 1.43; font-size: 1.5em; position: relative; font-weight: bold; color: rgb(51, 51, 51); font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif;\">Essentials for this Trip</h3><ul style=\"padding: 0px 0px 0px 2em; margin-bottom: 16px; font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\"><li>Sleeping Bag</li><li>Sleeping Mattress</li><li>Trekking/ Walking Shoe</li><li>Cotton Socks</li><li>Sandals or Floaters</li><li>Plate and Spoon (Non “use and throw” please)</li><li>Coffee Mug</li><li>Water Bottle</li><li>Earthen/Natural colored clothes – Jeans is absolutely not recommended</li><li>Warm Clothings (It’s expected to be quite cold at Mul Pokhari)</li><li>Sun Cap</li><li>Rain-coat/ Umbrella</li><li>Personal Medicines, Band Aid, Crepe Bandage, etc.</li><li>Toilet Paper</li><li>Soap/ Soap Paper/ Hand Sanitizer</li><li>Torch Light</li><li>Spare Newspaper</li><li>Spare Plastic Carry Bags</li><li>Photo Id Proof (Both Original and Photocopy)</li><li>Camera</li></ul><span style=\"font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\">Note: All photographs in this site are either taken by me or by my friends.</span><span style=\"font-family: \'Helvetica Neue\', Helvetica, \'Segoe UI\', Arial, freesans, sans-serif; font-size: 16px; line-height: 25.6px;\"><br></span></div>','COMPLETE','mulpokhri, camping, trek, sikkim, khangchendzonga'),(15,'give_linux_a_chance','http://xubuntu.org/wp-content/uploads/2015/02/1404_whisker.png','2016-03-13 04:29:45','Pratik Sengupta','Give Linux a chance to impress you','2016-03-15 13:11:18','Pratik Sengupta',NULL,NULL,'<p class=\"lead\"><br></p><p class=\"lead\">For God\'s sake give Linux a chance to impress you</p>\n<div>Let me start with a few myths, issues that used to confuse me and their work arounds.</div>\n<div><br></div>\n<div>\n   <ol>\n      <li><b style=\"line-height: 1.42857;\">Linux is command driven OS and I don\'t know linux commands</b><span style=\"line-height: 1.42857;\"> - Hey, come\'on we are not living in 90s any more, linux distributions (distros) does come with a UI ! :) Take Ubuntu, the most popular distro. There are n-number of distros available in Linux which is it\'s great advantage as well as disadvantage. Advantage because we get to choose between various options and the disadvantage is the development is not concentrated in one area. Ubuntu, Xubuntu, Lubuntu, Kubuntu, Mint etc are a few flavors.&nbsp;</span></li>\n      <br>\n      <li><span style=\"line-height: 1.42857;\"><span style=\"font-weight: bold;\">Linux UI is ugly</span> - In linux the front-end UI and the backend are decoupled from one another. The frontend UI is called a desktop environment and as such one can switch from one desktop-environment to another without changing the backend. Now coming to the asthetics the desktop environments does provide a highly customizable UI and is comparable to that of Windows/Mac. In fact few of the UI features in Windows are borrowed from linux (check google for the that).</span><br></li>\n      <br>\n      <li><span style=\"line-height: 1.42857; font-weight: bold;\">Linux is for programming freaks</span><span style=\"line-height: 1.42857;\"> - Though I agree that it is very helpful for most of the students with CS/IT background students (remember the Operating System subject which mostly deals with Linux architecture and a little bit of other OSes towards the end !) but that does not mean that it\'s not suitable for normal users. It is the same uncomfortable feeling that one encounters moving from Windows to Mac. In India most of us are quite used to Windows since our first interaction with our PCs/Laptops and hence we are very much familiar with the UI schemes of Windows. We see windows at the offices, schools, cyber cafes and almost everywhere, so when we use it in our PCs/Laptops the learning curve is less steep. Linux distro\'s UI schemes are a bit different from Windows, obviously you can\'t expect the start menu with the \'Windows\' logo :P but with a different logo. Give it a few days and you should be fine.</span></li>\n      <br>\n      <li><span style=\"line-height: 1.42857; font-weight: bold;\">Linux does not support Video Games </span><span style=\"line-height: 1.42857;\">- While it is true that the most popular games that we play in Windows won\'t be available in Linux (not complicating things here by introducing Wine software) but there are video games that are available in linux as well ! Not able to play my favorite video game in linux was one disappointing factor for me to consider switching to linux but allows easy dual booting i.e. you can have Windows and Linux both in the same PC/Laptop. Let\'s say you already have a Windows version installed in your computer and you want to try linux for a few days with an option to fall back to windows at any instant for Video games or any other reason. Create a separate hard disk partition (assuming you have enough space for a separate hard drive partition of min 20GB available for linux). Just install your favorite linux distro on top of windows and select the option to keep Windows as is during it\'s installation. Post installation the boot screen will have an option to load windows or the linux distro that you installed.&nbsp;</span></li>\n      <br>\n      <ul>\n         <li><span style=\"line-height: 1.42857; font-weight: bold;\">Caution</span><span style=\"line-height: 1.42857;\">: Linux distro should be booted after Windows as Windows boot-loader does not honor the linux installation.&nbsp;</span><span style=\"line-height: 1.42857; font-style: italic;\">Do not do this if you are not comfortable with OS installations and it is always recommended to have a backup of your hard-drive first to avoid data loss due to unforseen circumstances. There are a lot of youtube videos and blogs demonstrating that and it is recommended to visit them first.</span><br></li>\n      </ul>\n      <br>\n      <li><span style=\"line-height: 1.42857; font-weight: bold;\">MS Office won\'t work in linux</span><span style=\"line-height: 1.42857;\"> - This is not a myth and personally Office suite is one software that I still miss in linux though there are substitutes like LibreOffice but switching back and forth a document from MS Office to LibreOffice or vice versa doesn\'t work that great. The easiest solution is to use Online editing using www.office.com and the second one is as mentioned in the previous step - dual booting windows.&nbsp;</span>Personally I like the Xubuntu distro and dual boot Windows for Video games.<br></li>\n   </ol>\n</div>\n<div><br></div>\n<div><span style=\"font-weight: bold;\">It\'s advantages&nbsp;</span></div>\n<div>\n   <ol>\n      <li><span style=\"line-height: 1.42857;\">It is free and there are regular updates</span><br></li>\n      <li><span style=\"line-height: 1.42857;\">Almost all the linux distros boots up and shuts-down faster than Windows</span><br></li>\n      <li><span style=\"line-height: 1.42857;\">Works fast even with old outdated hardware which you cannot even think of installing Windows XP ! Refer to LUbuntu\'s recommended hardware specifications then you will understand what I mean.&nbsp;</span></li>\n   </ol>\n</div>\n<div><span style=\"font-weight: bold;\">One major drawback </span>using linux (<span style=\"line-height: 1.42857;\">though&nbsp;</span><span style=\"line-height: 1.42857;\">linux is not responsible for that) is getting compatible drivers for specially old hardwares. Most of the hardwares vendors do not provide linux drivers for their products just like they do it for Windows, and as such if things work out of the box after installation like webcam, wifi adapter gets detected automatically then you\'re fine otherwise you have to install them manually which involves a lot of pain and might require a few terminal commands. Luckily most of the recent hardwares are detected and works out of the box.</span></div>\n<div><br></div>\n<div>Often I have come across friends saying that linux is not for me even without knowing the facts. To conclude the idea of this blog is neither to influence people to switch to linux immediately nor to project Linux superior to Windows, rather to make them aware of the facts so that they can take an informed decision. So are you ready to give it a shot ?</div>\n<div><br></div>','COMPLETE',NULL),(16,'har-ki-doon','https://lh3.googleusercontent.com/S5AA74piiFcZbqNQhIAQSb29j0zoMQ2EPiDlO8nex8cgxSbchgT05jZbBuTB_Lsa_OvBCk9-dDf1zV3B5GTEVF2NUw4dxyhf2-iP4eoNX5OlJ8ceKd_2cIQT61gYb-d8JJ5R9R1I8B2ZH59sFb6ffUXaJPZDC2-yGfVAwH-19vCj03cMObhYzVUdYmqSrUx2IaOJj7UTZBGDfzVPrJm1TM2xCHH0ayl4MIc3Fhg7bfHiZM9mfazkCk_oV-IkpdrBWU6WMmT0ASGY2-YAHbuzK2mripCpDllOhkGeORNgiQ7DrU_YGmkkKmm_LQ8hDz7T3rKcjCCALCKudzcny__J6EXp5TtSrrz29_-DaKLSPfju653cuLwrFNPw85NEi2k2wFEHYt__ZAWmnUTliOeSsbVnaWj4DxxBWrCu0bHDY7diFMjYpUqwp0csW5v4Mtih1awOWe0m82_dffX1_w1BcqfzlKOg9KVHqcmzzWYcD77XiySTY-jfWrJFDGvR7fBIkff5Y-ThmHPUlxVfY6DR6DAIAEDYBHUYxGckUTvpLFI6FEzjhQiE1ATjY1Fic4XzZBtAvAN3ffmRDWUWKuHL8DsJ7LqiGPL4WUDt_2vHzv4OPkbBezVT_nQP_LqeZbAcMfeK79GACLhWmfraLzgHK-3Yt43wlTQeLiW4gJ4DnQ=w1486-h990-no','2016-04-16 13:30:27','Barsha Sengupta','Har Ki Doon','2017-01-06 13:17:34','Barsha Sengupta',NULL,NULL,'<div>Life is daring adventure or nothing at all.....We(me and my husband) thought of this and started our 1st trek of the year Har-ki-Doon with India Hikes-a well known trek &nbsp;community helps us &nbsp;to explore the beautiful mountain ranges in India. Har-ki-Doon is a well known valley in Gharwal district of Uttarakhand, India. A 8 day trek with India Hikes and the lovely trekkers we meet in this journey.</div><div><br></div><div>As the travel period consists of 2-9th April, we started Friday night that is 1st April from Hyderabad to Delhi, so that we can catch the Nanda-Devi Express from New Delhi Railway Station to Dehradun Station at 11:50 pm, which will take around 1200rs for two people in 3-tier-AC.</div><div><br></div><div>Let start with Day 1- &nbsp;We reached Dehradun Station early in the morning by 5 am in the morning. On the train we meet some people having Quechua bags, that\'s to conclude that they are also going for trekking. One thing to tell is Quechua is a well known brand selling some really good quality stuffs for trekkers. We also got our shoes and other materials from Quechua. I must tell Quechua shoes are really amazing both for ladies and gents. For gents they recommend Forclaz 500 High and for ladies Forclaz 500. Coming bank to the train , the other guys are for KedarKanth basecamp, another amazing destination for trekkers. After we reached Dehradun, we gathered outside the station. India Hikes management staff arranged for a Cab(Bolero) and took us to our first destination Sankri. We trekkers had to bear the charges, which was around 1000 or 1100 for per-head. The fact is, this journey of around 210 km and is really really tiring though the views are mesmerizing. It takes 8 to 9 hrs to reach the last village which is the first camp stay of both Har-ki-Doon and Kedarkanth base camp. People having motion sickness please take medicine. When we reached Sankri - a small village with ample amenities, but people here are more generous, more kind and the most happiest !!. Point to be noted, from here you can watch Har ki doon peaks and Black peak(KalaNag Parvat-source of yamuna river).At Sankri, we were welcomed by our trek lead Mayank(the coolest trek-lead), at that point of time we dont know that he is our trek lead for Har-ki_Doon trek. A very generous man, leaving his carrier enjoying in the laps of mountains and helping other to achieve it. Our hotel name is Wild Orchid provided by India Hikes.On that day, we reached around 4 or 5 in the evening, all your energy drains but as soon as u see the misty mountains , I really dont know from where the energy level start rising. We were asked to bring the required documents for submittimg with our cups and plates because it is Tea-time . During snacks time we meet another lovely person Prahlad ji. The localities and our guide for the trek.He always wear smile on his face and encourage people. You know the most amazing part of anything is food(my thoughts though) and what if you get some amazing food in the mountains, what a combination. Yes India Hikes provides with the best food you can hardly imagine during trek. The pakoras with tea are just awesome.We meet our 15members and the two trek lead, one guide and Ganga Ji. I can bet, this type of person with such good thoughts you can never find in so called civilized world.GangaJi is supposed to be the last person in trek who will watch that nobody leaves the group and trek together. &nbsp;You cant expect a 5star rooms in this area, but believe me the rooms view and their generousity is much more worth than 5star hotels. As i said earlier the food is beyond compare, we got &nbsp;some amazing food for dinner as well.The day end with warm sleep in bed and blankets because from next day onwards,we had to stay in tent inside sleeping bag.</div><div><br></div><div><br></div><div><br></div><div>Day 2--Destination Puani Garat--Was so tired to wake up and then get fresh(a small remainder-you are not going to bath for next 7days and forget about western style:p) , as India Hikes had their own protocols ,at 6:am we are supposed to get our tea, at 7:am breakfast and by 8 we have to leave for our next destination.The day consists of 13km long trekking and a hour of drive to Taluka-a small village again after which their are no mobile networks, no roads for vehicles.So we can say Taluka will be our starting point. Now, Lunch you have to pack for the day, as it will take around 8 hours ,the trail is mostly alongside the Supin river, crossing over a few bridges. We all are set for the trek, 17trekkers with 2 trek lead, 1 trek guide and &nbsp;our dear Gangaji. What an hectic day it was, as i have carried my own backpack and that to for 1st time, initially it will be tough but gradually you will get the pace.The scenic beauty is what makes you forgot all your personal problems. Why we go to mountains, just to keep our usual boring life at stay and to know who we really are, what we really enjoy and what keep us haapy. No internet, no network just nature and you. We come so close that at the time of leaving the feeling kills us. Commimg back to the trek, all are really doing well, our group consists from freshers medium to really experienced one. On the way we took rest where we wanted to get some energy, took some lovely pictures, trying to know all of them while trekking.That day was really hot, sun was scorching, so you need good sunscreen and a cap!..We took lunch break at a dhaba,you will get maggie,drinks,eggs and choclates there. As we got some deliciuos lunch(roti and sabji) , we didnot opt for it. After taking half hour break we again started for the next half of the trek. By this time , we had already coverd 7 to 8 km and next 6 km we had to cover before the sunset. On the way the guide and lead are very encouraging, telling us that we are really doing well.Eventually it boosts our energy.Finally we made it, by 4pm we all are in our first camp site.Wowww, what an feeling it was, as if I am Bachandri Pal. We saw some tents already pitched by the staffs.They offer us their localities drink called rododendron tang!yummy it was. The weather is changing now, from scorching sun to chilly, people select their tent.Per tent 3 people can acquire and their are 7 tents in all for sleeping. As soon as we are freshed our dear Prahlad ji call us for some physical activity ,now this is something intersting after a long day trek if you do some activity, you really feel freshed! Zikuja- a game named by Prahlad ji, a message activity but we really enjoyed it! Then came time for snacks and you cant believe what is there for snacks, yes it is \'Macroni\'-i mean how come you get such yumm macroni in mountains!!we all aplaud for the chefs! and yes for India Hikes. We click some good pictures there.I tell you , you also have a night life in mountains ,especilly in dinning tent where people are busy playing cards and showing tricks, here we meet one wonderful person Jagnoor Singh Garewal though we called him Jagnnor_G(G for Genious)-what a man he is, so generous,so humble,social and what not,pleased to have him on this trip. By that night all people knows each other and we really rocked.Dinner was as usual scruptous roti sabji dal rice salad and dessert, now who gives you dessert in mountains,yes India Hikes gives. A well day spent and some captured in camera and some in memories, still freshed and vivracious.Finally sleeping bag and tent experience is waiting for us.I got Dr Shweta and Roopa an Engg by poroffesion from Banglore as my tent-mate, &nbsp;we mangaged to adjust and turned to be best mates(tent one). Somewhere while sleeping a thoughth came to my mind,why this beautiful day had to be passed so soon.I am so happy and relax here, mountains I am in love with you.</div><div><br></div><div><img src=\"https://lh3.googleusercontent.com/1xbwr52gH4LAAgaRv42_LE3ZgKjSGVr8lxrB-21efFpIdC1iJ8bA8tjnreJ-2RIZuwsNOKh7BHIOJZo8KvAQhdUrRIXFrZE4d-rM_QWrweQhGEz3ihVp3ADVIpY_iUq29HrXdN4wtJW78wDNUCbb9vKn4kRn5mhUi_ipOpO0tFLzKFzkZpFVQcAGv5Z_52V8OUwfzDgGiIr1WPDxgkjBH45T3XkVkwKvbsTEsS_0u9BsnzfQp1l2IXNIXt9mHlRD14vP3EXtOAIfgu693QEJiNjaPEle___Qy4moh1I65f_OWW821C3alPvojHSxVy3VDHK-4fARZ9IwNPFBPq8eh95DaNRFm-OzJYsaK7L95rafG1N-SidV5WlCN7cLbVXKWuu2bNkgOkkZOV2stQpzhcfwHlqNu0yOJaRL7u_5cn6A0mks8SpkXA7bmNNl6wxgOyB0s1caVDvMIL7u9Fgmb8tMStdz12rmYJmeDMQJfGvQuLQM2tXJvjuXbvDUSAwGaswojDqBi6KEf2r6_Fnqghl6u5yTxzCmlJh4owRLnDNooDH_47OC-BqZUqgKlVCfqe24=w1493-h996-no\"><br></div><div>\r\n	\r\n	\r\n	\r\n\r\n\r\n<p style=\"margin-bottom: 0cm; line-height: 0.53cm;\">\r\n	\r\n	\r\n	\r\n\r\n\r\n</p><p style=\"margin-bottom: 0cm; font-variant: normal; letter-spacing: normal; font-style: normal; font-weight: normal; line-height: 0.53cm; widows: 1\"><br></p><p style=\"margin-bottom: 0cm; font-variant: normal; letter-spacing: normal; font-style: normal; font-weight: normal; line-height: 0.53cm; widows: 1\"><br></p><p style=\"margin-bottom: 0cm; font-variant: normal; letter-spacing: normal; font-style: normal; font-weight: normal; line-height: 0.53cm; widows: 1\">\r\n<font color=\"#333333\"><font face=\"Gotham, Helvetica Neue, Helvetica, Arial, sans-serif\"><font size=\"2\" style=\"font-size: 10pt\">Day\r\n3; The difficult part of this generation is they cant get up\r\nearly,but wait this situation occurs when the life is monotonous but\r\nyes when you are in himalayas,your daily routine changes man,early to\r\nbed and early to rise coz no electricity.It was 6 in the morning,as\r\nIH says at 6:am tea,7 am breakfast and by 8 we need to start as you\r\ndont know about the weather and speed of the trekkers accompaing\r\nyou.I just cant believe my eyes what i see in the morning,my\r\ndestination yes the har ki dun peaks which is partially visual from\r\nthe distance.The sounds of stream,birds chirping,cool breeze and hot\r\ntea—deadly combination.Finally we had our breakfast got our lunch\r\npack and started our trek for the day,the destination for the day was\r\nKalkatiyadhar which is 7km from our current place and it should take\r\naround 6hrs.We started our trek around 8:30 ,we passed a small\r\nvillage(not that small too) Osla,it looks beautiful same pattern home\r\nall over,i love the trail we crossed a bridge and took some pictures\r\ntoo,the elevation was increaing so our trek lead asked to continously\r\nhave some water.The most difficult part of the trek according to\r\nme,because to reach their you need to cross two mountains,and guess\r\nwhat suddenly the sun  shine day tuirns into heavy rainfall.Now for\r\nthis situation poncho is the best thing unfortunately I was carrying\r\nraincoat tough a branded one but of no use,my back got totally wet\r\nboth because of raincoat and backpack,we stopped in a place from\r\nwhich is a kind of valley,we took rest and had our lunch ,fortunately we met a group of bengali,4 to 5 people,having lil born fire under\r\nthe roof,the weather was turning chilly and windy so i took off my\r\nraincoat and tried to make it dry.The best part of the trek was\r\nbholu(himalayan dog)our friend cum companion for the trek. Pralad\r\nbhaiya asked us to make quick because weather is turning off and we\r\nneed to reach our campsite for the day and pitch our tent,meanwhile\r\nwe crossed a landslide area,omg how nervous i was to cross that\r\narea,full slanting and because of rain full wet and slippery but we\r\nall had made it. Kalkatiyadhar--somehow we can guess it is a side of a\r\nmountain and in front a glossy,gorgious and sharp mountains  and\r\nother side lush green mountains,by the time we reach,kitchen tent was\r\nalready pitched,then we all first time pitched our tents,the day was\r\nhectic and we are hungry,i forgot to tell in afternoon we had our\r\nroti sabji made by the IH chef!!! In the snacks we got chowmin,it was\r\nas awesome as the other day of the meal.Then we started our gossip\r\nand games round inside the dinning tent,finally dinner was served and\r\nafter the amazing meal,we went for the much needed snap.</font></font></font></p><p style=\"margin-bottom: 0cm; font-variant: normal; letter-spacing: normal; font-style: normal; font-weight: normal; line-height: 0.53cm; widows: 1\">\r\n	\r\n	\r\n	\r\n\r\n\r\n\r\n</p><p style=\"margin-bottom: 0cm; line-height: 0.53cm;\">\r\n<font color=\"#333333\"><font face=\"Gotham, Helvetica Neue, Helvetica, Arial, sans-serif\"><font style=\"font-size: 10pt\">The\r\nbest part of trekking is ,all day you just enjoy the scenery and at\r\nthe end you are so tired(which only your body knows) that as soon as\r\nyou go inside sleeping bag you fall asleep, a deep sleep and suddenly\r\nin the morning some body shout that ‘Oh look our tent is covered\r\nwith frost and look at the misty mountains’ and suddenly you\r\nrealised another day is waiting for you.</font></font></font></p></div><div class=\"_GAlLb\" data-guidedhelpid=\"trackingheader-trackingid\"><div class=\"_GAlLb\" data-guidedhelpid=\"trackingheader-trackingid\"><br></div></div>','COMPLETE','Kar Ki Doon, trek, himalaya, indiahikes'),(17,'ChatTest','','2016-07-12 12:59:49','Pratik Sengupta','Chat Test','2016-07-13 06:12:27','Pratik Sengupta',NULL,NULL,'ki koro','DRAFT',NULL),(18,'resteasy-quickstart-wildfly-10','https://fedoraproject.org/w/uploads/a/a3/Wildfly_logo.png','2016-08-13 13:00:09','Pratik Sengupta','RESTeasy quick start on Wildfly 10','2016-08-14 04:52:22','Pratik Sengupta',NULL,NULL,'<div><div><div><div>It\'s been sometime working with REST-APIs so thought of writing a quick start on JBoss App server\'s latest version Wildfly 10. It is always recommended to use the APP server\'s provided dependencies as the first choice. So here it is:</div><div><br></div><div><span style=\"font-weight: bold;\">Dependencies Pom</span>:</div><div class=\"blog-link\">https://raw.githubusercontent.com/pratik006/tutorials/master/ejb/resteasy/pom.xml<br></div><div><span style=\"font-weight: bold;\">Create a simple model class which we would return from the REST service</span></div><div class=\"blog-link\">https://raw.githubusercontent.com/pratik006/tutorials/master/ejb/resteasy/src/main/java/com/prapps/tutorial/ejb/rest/model/Book.java<br></div><div><span style=\"font-weight: bold;\">Create the REST service wiht basic jax-rs annotations</span></div><div class=\"blog-link\">https://raw.githubusercontent.com/pratik006/tutorials/master/ejb/resteasy/src/main/java/com/prapps/tutorial/ejb/rest/service/LibraryService.java<br></div><div><span style=\"font-weight: bold;\">Finally Create the REST activator</span>&nbsp;- Since we are not using any web.xml to wire the container. Alternatively this can also be configured using web.xml as shown here:&nbsp; <a href=\"https://docs.jboss.org/resteasy/docs/1.0.1.GA/userguide/html/Installation_Configuration.html\">https://docs.jboss.org/resteasy/docs/1.0.1.GA/userguide/html/Installation_Configuration.html</a> but I perefer the full-java approach :)</div><div class=\"blog-link\">https://raw.githubusercontent.com/pratik006/tutorials/master/ejb/resteasy/src/main/java/com/prapps/tutorial/ejb/rest/ApplicationConfig.java<br></div><div>Run mnv clean package and put the&nbsp;<span style=\"font-weight: 700;\">restful-webservice.war&nbsp;</span>into the deployments folder in the App server and start. Once the App server starts hit the url:&nbsp;</div><div>You should get a response like:&nbsp;<a href=\"http://localhost:8080/restful-webservice/library/books\">http://localhost:8080/restful-webservice/library/books</a></div><div><div class=\"line\" style=\"color: rgb(0, 0, 0); line-height: normal;\"><span class=\"html-tag\">&lt;collection&gt;</span></div><div class=\"collapsible-content\" style=\"margin-left: 1em; color: rgb(0, 0, 0); line-height: normal;\"><div class=\"collapsible\" id=\"collapsible1\"><div class=\"expanded\"><div class=\"line\"><span class=\"button collapse-button\" style=\"-webkit-user-select: none; cursor: pointer; display: inline-block; margin-left: -10px; width: 10px; vertical-align: bottom; height: 10px; background: url(&quot;data:image/svg+xml,<svg xmlns=\'http://www.w3.org/2000/svg\' fill=\'#909090\' width=\'10\' height=\'10\'><path d=\'M0 0 L8 0 L4 7 Z\'></path></svg>&quot;);\"></span>&lt;book&gt;</div><div class=\"collapsible-content\" style=\"margin-left: 1em;\"><div class=\"line\"><span class=\"html-tag\">&lt;isbn&gt;</span><span class=\"text\">123asd</span><span class=\"html-tag\">&lt;/isbn&gt;</span></div><div class=\"line\"><span class=\"html-tag\">&lt;title&gt;</span><span class=\"text\">My Gita</span><span class=\"html-tag\">&lt;/title&gt;</span></div><div class=\"line\"><span class=\"html-tag\">&lt;author&gt;</span><span class=\"text\">Devdutt Patnaik</span><span class=\"html-tag\">&lt;/author&gt;</span></div></div><div class=\"line\"><span class=\"html-tag\">&lt;/book&gt;</span></div></div></div></div><div class=\"line\" style=\"color: rgb(0, 0, 0); font-family: monospace; font-size: 13px; line-height: normal;\"><span class=\"html-tag\">&lt;/collection&gt;</span></div><div class=\"line\" style=\"color: rgb(0, 0, 0); font-family: monospace; font-size: 13px; line-height: normal;\"><span class=\"html-tag\"><span style=\"color: rgb(51, 51, 51); font-family: Gotham, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 14px; line-height: 20px;\">and</span><br></span></div><div class=\"line\" style=\"color: rgb(0, 0, 0);\">The JSON/XML type response is taken based on the client\'s request header\'s \'Accept\' parameter. If no header is set then the RESTful service is free to decide the response type.</div><div class=\"line\" style=\"color: rgb(0, 0, 0);\"><br></div><div class=\"line\" style=\"color: rgb(0, 0, 0);\">I am using Postman plugin for Chrome to set the headers. Lets try first by setting the header explicitly to \"application/xml\".</div><div class=\"line\" style=\"color: rgb(0, 0, 0);\"><span class=\"html-tag\"><br></span></div><div class=\"line\" style=\"color: rgb(0, 0, 0);\"><span class=\"html-tag\"><img src=\"https://lh3.googleusercontent.com/hUSJJwP9mAykhJJW7v1szEwjqzu6BDX4xrG3blNHdhcjt6iQWG8iPTalg0QrasbMBiBitFMewSCs1CneAd7IsDSfMzbS9RGbcETFkLogNrR8vc1JnvRqNC1YVfW0SA1ouxOng60ds8WJhIpMFzb1UqCZ17U7friHHqmscd29X7Dr39DVkGcn9UUaQGfcphkYP0YN3oaqrO_ndH1ua5fdplQUE0FqjtBv0VfjA8UkI2f2i_nDsNc61VH1mwsXmZAdjbn1-VIEnlgfuTeJFAzGX2meeUUE8JUIiOZrboEb5Ze41J1stn61rMHMYWUmUUMW3uZS-BhPUvEq_-xUD49JmdVc70q0v9OMpMgybmyWOK-kjlTNhn2jL5_K-QA3W79VJXcqYcM8p7OeROxRm3KriewYHTlzWcuyOwYkMGXmpmXMXmUXznzPrRtnepdmZLMdSD9TK887T93OtDdLZsvXbXkost18BmNxDsUlO69YeuwSShVuna7Fr2KnU24SASlRYN69iRDJTOlki1V4WSi-hFo1Fpw5RFWTGAjkdoJyW5W8GiTAR79gNn_Rjl1m2_sFFtAIllTgg2esCQLFcPpYa0Y0KbPTJ78=w1079-h394-no\"><br></span></div><div class=\"line\" style=\"color: rgb(0, 0, 0); font-family: monospace; font-size: 13px; line-height: normal;\"><span class=\"html-tag\"><br></span></div></div><div>As expected we got an XML response. Now lets try setting the header to \"application/json\".</div><div><img src=\"https://lh3.googleusercontent.com/UaS21Q3ejR0r1cQF-xluMMdTGljbFLHtiKDRJylQiYEceurPijWY0Z06KISMvzPgOyv0Xs7qnWSGXiRLK9I1kcmrFs3m8YWNLYzrFxAEz7xMrfY-986MG5AC4Deydy4g8z2SuUEtkrCKN_eBk6KiE5x2-1k7VpyUboILzctNQbRX_Me-G8Jrvby-AKryDL0SrUEXluFbAHBbL2erG_FnTRA4XksGjz_4M9w0_-K0XCnUBzpC5CIIr6M9Iz4MgAPEcxUQRGeqQ16tG-rqXriYK0vxaazw7aTjwSRExY5Carji8BpTw-NQztJz4s-LsUhB88LuwR3G9aEP7u4-WI8lC9OJndWMg9Vmc6iTfi-6EEbgpe2W4CEvT9FornojRerZuIhnCxsNQJi-jkXYAraMV8HWBf87_1qo0ybU4q6rCSusK07VP97W4FKWqjAeiF7hZJT1iC_E9Qswcz5CE1et1N504u-IurGsDv2-TApTR5lZ8GvruUN0VE92r3g03lRSY7g6wOh1rGjztVYn6qGievjYJ6raHTzDdoKDr7Jvvm22etBNq6ZFwA-P2GH_-LcVwqCzx9gsJnIgr3nqHzaPmihjjc5xbSc=w1073-h373-no\"><span style=\"font-weight: bold;\"><br></span></div><div><span style=\"font-weight: bold;\"><br></span></div><div>As expected the service returned Json response.</div><div><span style=\"font-weight: bold;\"><br></span></div><div><span style=\"font-weight: bold;\">Key takeaway:</span></div><div><ul><li>Do not set seperate url path mapping for XML and JSON if the RESTful service is supposed to handle both JSON and XML.</li><li>Let the client set the request header accordingly. Set \'Accept\': \'application/xml\' for XML response and set \'Accept\': \'application/json\' for JSON response.</li></ul></div><div><span style=\"font-weight: bold;\"><br></span></div><div><span style=\"font-weight: bold;\">Conclusion</span></div><div>The intention of this article is write the jax-rs based services but to set-up the dependencies using the App service provided dependencies which sometimes creates problem.</div></div><div><br></div><div>The source code is available at&nbsp; <a href=\"https://github.com/pratik006/tutorials/tree/master/ejb/resteasy\">https://github.com/pratik006/tutorials/tree/master/ejb/resteasy</a></div><div><br></div><div><br></div></div></div>','COMPLETE',NULL),(19,'syntax-highlighting-dynamic-prismjs','','2016-08-15 04:38:17','Pratik Sengupta','Syntax highlighting dynamic content with Prismjs','2016-08-15 06:03:16','Pratik Sengupta',NULL,NULL,'Syntax highlighting dynamic content with Prismjs\n\n\nsyntax-highlighting-dynamic-prismjs\n\n\n\n\n\nWhen it comes to client based syntax highlighting there are a few options like\n\n	Prismjs\n	Syntaxhighlighter\n	highlightjs\n\nBut most of the examples deal with highlighting static data however I faced issues while highlighting dynamic content. So here is my usecase - When you navigate to a page the content of is returned as a part of json which might contain embedded github urls. We need to highlight them. Turns out that it was fairly easy with Prismjs but I had to spend quite some time to get it to work :(&nbsp;<div><br></div><div><div>Let me share what I did.</div><div>I use a div with class=\'code\' and I want this to fetch the code from github and render it here with proper syntax highlighting.</div></div><div><br></div><div><div><span style=\"font-size: small;\">&nbsp; &nbsp; &lt;div class=\"code\"&gt;</span></div></div><blockquote style=\"margin: 0 0 0 40px; border: none; padding: 0px;\"><div><div><span style=\"font-size: small;\">https://raw.githubusercontent.com/pratik006/tutorials/master/ejb/resteasy/pom.xml</span></div></div></blockquote><div><div><span style=\"font-size: small;\">&nbsp; &nbsp; &lt;/div&gt;</span></div></div><div><br></div><div><div>For that I wrote this small script:<div class=\"code-block\">\n	$(document).ready(function() {\n	    var re = /(?:\\.([^.]+))?$/;\n		$(\'.code\').each(function(index) {\n			//retrieve the url within the div element\n	        var url = $(this).text();\n	        //get the file extn from the url\n	        var language = \"language-\"+re.exec(url)[1];\n	        var that = this;\n	        \n			$.get(url, function(response) {\n				//we need to replace \'&lt;\' and \'&gt;\' signs with corresponding html codes\n				response = response.replace(new RegExp(\'&lt;\', \'g\'), \'&lt;\');\n				response = response.replace(new RegExp(\'&gt;\', \'g\'), \'&gt;\');\n\n				//add the required tags for prismjs to identify\n				$(that).empty().html(\'<pre><code class=\"+language+\"><div>\'+response+\'</div></code></pre>\');\n\n				//start the syntax highlighting for this particular div\n				Prism.highlightElement($(that).find(\'div\').get(0));\n			});\n		});\n	});</div></div></div><p><br></p><p>A running demo can be found&nbsp;<a target=\"_blank\" href=\"https://jsfiddle.net/pratik006/dh70pckp/4/\">here</a></p><p>So I have used the \'<i>Prism.highlightElement</i>\' api for syntax highlighting.</p><p><br></p>','COMPLETE',NULL),(20,'kartilswamy-deoriatal-chandrashila-trek','https://lh3.googleusercontent.com/QNQMw6HpbQo-Rm-GnB1oI9Xv68quGsodlJJoMoa4SwDa9e5oVS2RyL7dDQJsLsnRgGmu_n7RdyDVC86x-fCoDH7FwDjwh-fAzdVAxHd4oFrvyN1QacFb5oEDDOi2uLCTARrvK738VEs3atwD7jzKECHE8L_mCd1BrzZGFSfBJQIzT10pOlDIgiJa1DqLWKp8L6RTXWhWfQjnFQisRt7d-kss2AT4Y6CEMUNcM3LZ0SgveqA6nsioWnZwK9dVNZszJkbsJQK7KIOb1GYuowIuz82f_VaJGbMxRWw9ONhLr4JZEu1a2mlNEYobr6Og2BHjKAWWhJ3ec4L1FSqVyuqIUYdt3C-u_pCQle2C6715xDoX_A8X6wEE7KyNIqOvyi45M6aLhBEBplzQ9aReyALKbBeku5M2OZCChtoL7dFOZVOI1lwAb7N0eaTlK71_hemTPp6DQo4mtaF9vEjsQBv31uq9I8cVvXxLu1KrKkwhvrOvWkXIRLhK3oDleZMyWXfctCqijdXH3jmExe4_nrKZR2PrhZqvGjKiOuzWcFw5rj8kABrBm9TP4YcphX1Em9wz6bdXwWfQv1Y0bU-DWPP_cRg-rUCO7Dbd1ccKhfqfii509msV7wJjgamypmex2hsenoauiY8Be3sR4QcPAcOsVPCpa0_veDlG-4b74cWhFA=w1486-h990-no','2017-01-03 06:02:11','Pratik Sengupta','Kartikswamy, Deoriatal and Chandrashila Trek','2017-01-10 06:28:50','Pratik Sengupta',NULL,NULL,'<span id=\"docs-internal-guid-3532dad5-63fe-c775-3ed9-38fae40a87c2\"><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><b>Short Travel Itenary</b></span></p><br><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-style: italic;\">Day 1</span>: New Delhi to Haridwar via Nanda Devi express</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-style: italic;\">Day 2</span>: Haridwar to Kanakchouri via Rishikesh, Rudraprayag</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-style: italic;\">Day 3</span>: Early morning trek to Kartikswamy temple and then travel to Deoriatal via Monkhal, Banswara, Ukhimath and Sari. Trek to Deoriatal</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-style: italic;\">Day 4</span>: Stay at Deoriatal</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-style: italic;\">Day 5</span>: Trek down from Deoriatal to Sari and then to Chopta by a Jeep</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-style: italic;\">Day 6</span>: Trek to Tunganath and Chandrashila and back</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-style: italic;\">Day 7</span>: Back from Chopta to Ukhimath</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-style: italic;\">Day 8</span>: Ukhimath to Haridwar via Rishikesh</span></p><div><span><br></span></div><div><span style=\"font-weight: bold;\">Expense Details as of December 2016</span><span><br></span></div><span style=\"font-style: italic;\">Transport&nbsp;</span></span><div><div><ul><li>Govt bus fare from Haridwar to Rishikesh : Rs. 35 per person<br></li><li>Bus fare from Rishikesh to Rudraprayag in private bus : Rs. 200 per person</li><li>Bus fare from Rudraprayag to Kanakchouri : Rs. 100&nbsp;per person<br></li><li>Bus fare from Kanakchouri to Monkhal : Rs 10 per person<br></li><li>Bus fare from Monkhal to Banswara : Rs. 70 per person</li><li>Bus fare from Banswara to Ukhimath : Rs. 25 per person<br></li><li>private Jeep from Ukhimath to Sari village : Rs. 500<br></li><li>Food and Tent stay at Deoriatal : Rs. 500 per person (need min 3 person group for this rate)</li><li>private WagonR from Sari village to Chopta : Rs. 800 (could be less if bargained properly)</li><li>private Jeep from Chopta to Ukhimath : Rs. 800</li></ul>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; [Note: the Bhookh hartaal bus service from Ukhimath to Gopeshwar remain closed after October and reopen in April, so one has to &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;rely on private vehicle in this route during winter season]<br><ul><li>Govt Bus fare from Ukhimath to Rishikesh : Rs. 305 per person</li></ul><span style=\"font-style: italic;\">Hotel/Tent</span></div><div><ul><li>Hotel at Kanakchouri Rs. 1200 for 4 (approx 800 for 2)</li><li>Food and Tent stay at Deoriatal : Rs. 500 per person (need min 3 person group for this rate)</li><li>Hotel at Chopta : Rs. 800 for 4</li><li>Hotel at Ukhimath : Rs. 700 for 4</li></ul></div><div>Guide contact at Deoriatal : Umendra Singh Negi (Phone: 8958647802), feedback - provide accomodation at lower rates than many others but had to lookout for him at night to identify which tent he has pitched for us as there were some 50 tents pitched at Deoriatal that day.</div><div><br></div><div><br><span><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><b>Detail Travel Itenary </b>(please bear with me then)</span></p><br><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-style: italic;\">Day 1</span>: We boarded the Nanda Devi express from New Delhi railway station. It leaves at 11:50 pm. We set our mobile alarms at 3:45 AM as it is schedules to reach Haridwar by 3:50 AM.</span></p><br><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-style: italic;\">Day 2</span>: </span><span style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">Haridwar to Kanakchouri via Rishikesh, Rudraprayag</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">The alarm rang but we could not figure out whether it was approaching Haridwar or not as it was still very dark and our mobile location services were not working. Then a station came and we figured out it was Roorkee. Haridwar is still 40-50 mins journey from here. So I again went for a short nap as it was going to be a long journey. Finally Reached Haridwar early morning at 5 AM. Still dark, we crossed the mail road and went to the Bus Stand opposite the railway station. There was one bus to Joshimath which was scheduled to leave at 6 AM. We thought we could take that bus till Rudraprayag. But there was only 3 seats available and rest all were occupied while we were 4. Then we checked at the Bus Stand enquiry and found that the next bus is at around 7:30 AM. As we were thinking on what to do next, we thought it would be a good idea have tea to freshen up a bit as we were still feeling sleepy. We stopped at a nearby shop beside the bus stand gate. While sipping our tea we saw one bus standing at the opposite side of the road which goes to Rishikesh. I just went there and checked with the driver, it is supposed to leave in 5 mins. As per my earlier information there are more number of buses are available from Rishikesh than from Haridwar. So we decided to board that bus. We reached Rishikesh in 30 mins. After reaching Rishikesh ISBT we looked for buses towards Rudraprayag but could not find any govt buses so one persone suggested us to go to the adjacent private bus stand. We went there and saw one bus to Rudraprayag ready to leave in 10 mins and there were ample seats available. We immediately boarded that bus. The bus left by 6 AM and by this time we could see a faint glow in the sky signalling dawn. Since I did not had much sleep last night I fell asleep and the next thing I know when the bus halted 10 kms before Devprayag for break. Becuase of my motion sickness problem I though it would be a good idea to have light breakfast and I had a half plate maggi. Then after an hour we reached Srinagar which is a quite big valley and a big township is there. Then suddenly our bus driver stopped there and asked all the passengers to change the bus to another one (a small bus with very bad condition). We resisted but we hardly had any choice. This is one primary reason why I prefer govt run buses in hilly regions because they adhere timings while the pvt run buses depend on the mercy of the drivers. So after changing our bus we started for Rudraprayag but it was hell of a journey as the seats were very small and there were hardly any shockers. Somehow we managed to reach Rudraprayag before 12 noon. I was still feeing the chill and realized what to expect at higher altitudes. After getting down at Rudraprayag I started enquiring about the bus to Pokhri which goes via Kanakchouri. Luckily it was waiting just nearby and was supposed to leave by 12:30. We decided to spend a few mins at one spot facing the sun. Then soon we boarded the bus towards Pokhri and informed the conductor to let us know once it reached Kanakchouri. The journey was very interesting and Kedar peaks were visible for the first time. After some time we reached Chopta (not to be confused with Chandrashila-Chopta, yes there are two Chopta\'s in that region). It was a 30 min lunch break. We had a light lunch and after a 30 mins it started again. I enquired that it should be around half an hour from here. Soon we reached Kanakchouri and I eyes went straight into the Mayadeep resort huts. We were told Rs. 1200 per hut and we bargained there to allow 4 persons there. The huts had one sofa cum bed where one person can easily &nbsp;stay. Since we were on low budget we thought of adjusting in one hut only. My next idea was to have a look at the road to Kartikswamy temple and get ourselves familiar where we will be trekking before dawn. We spent the evening relaxing and enjoying the quiet hamlet. We had dinner by 7:00 pm and went to bed early.</span></p><br><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-style: italic;\">Day 3</span>: </span><span style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">Early morning trek to Kartikswamy temple and then travel to Deoriatal via Monkhal, Banswara, Ukhimath and Sari. Trek to Deoriatal</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><img src=\"https://lh3.googleusercontent.com/TRp1Hz4ZGqTkPMX5TW3PfukfuQaUnc0l56FdYn36BCKCHYO-xt3eJzMFEGXVNJuOKxXDOu1oEfszykHFH8M0eP4bhX9JzdZzmvrudOcv31bZve5Ui_9oosylA18OK-PA0qNpJ3LxJk53R8sE5mKPUEELmhXsbcxaYVu2gGDGKmC_ZC8b5exL8VhoY1ur2H16RMQfvTDCZQJiuUhZP7bN67p0U-Xc2Yo1fGnxwnMCcZkPKEA-edZsSy6iBznJP2_8p1-1h2A6LL1CZOkoVJbIEOBnLzAFe3IZ76FdJXTZV9Mj_jB1IP05fzT8phu_2wVrguq1ihoOkr4Pb5pu531K8PCKIxc-zzT283kkPMiJb7eHl6QD9myTK6GfbMtzWL3IS6A2ic3-7KDedMStYd84L0OCFyIndsPSMfwifFCQsdsd06usVbIZ0yS98lNINm1RWi2F_1gXF37utcxuEEyXEjds_VCjzy9bGse7P5pxPLJIroK33eZi5CkrzEtSlVKQFpf0ttToOeE9Yef_Ax40dz0135aNAVu17UkG3qar_K3gpH9zXYUZURpe0aKfSS9fOB-JQrP0seI7mChe3eHCpIuRlMN1nyIdi1ebg2ywxZIk-J7KT7eozlXCyLp1RcBj4gIPsrNPTPQbXj-7Q3Ggpg66WH_QihoFe4IS5SX0KQ=w1412-h942-no\"><span style=\"background-color: transparent; white-space: pre-wrap; font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0);\"><br></span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">It was 4:30 AM in the morning when the alarm rang and it was very difficult to leave the cozy blankets to get ready. We got ourselves ready by 5:15 AM and started with torches. The distance from Kanakchouri to Kartikswamy temple is 3 km. The trail was pitch dark and we were feeling a bit scared to trek into such darkness due to fear of Himalayan Bears which I had heard are very common during this time as they come to the lower regions. As we were about to start we saw one village person standing there in the dark. He looked at us and understood that we were a bit hesitant to start the trek, so he said go ahead the trail is safe and after 15-20 mins the villagers from the top would start coming down with their ponies. That gave us a lot of courage and we started our trek.Since it was pitch dark we simple walk at brisk pace. After about half an hour we reached a small shade meant for resting of trekkers which was open from 3 sides. We waited there for few mins and we could feel that the color of the sky was changing. We increased our pace after that and followed the trail. After around another 30 mins we reached the place where the priest of the temple stays. By now we were able to see without our torches. There were 5-6 houses with one Dharamshala where tourists can stay. I was not aware of that otherwise I might have given a thought on that as well. Kartikswamy temple is another half km from here. I increased my pace from here as I was planning to capture the sunrise and its first light at Choukhamba. After another 15 mins of steep climb we reached a small temple of Vairo Baba. From here another 50m is the Kartikswamy temple. The view from there was amazing and simple cannot be explained in words. After spending a minute or two in the temple I went to the back of the temple where another group was already there taking photographs. I immediately set my tripod and started taking pictures of the mountains infront. Soon the Sun came from behind the eastern peaks (probably Trishul) and illuminated the Choukhamba massif. It was a spectacular view and I made most of my 55-300 zoom lens.</span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\"> </span></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><img src=\"https://lh3.googleusercontent.com/E-1JzRNjH12YTJo57d10UjeUgCwcJzgK8wZu8DalqQ-vmhIMXtzIYQIQD8voZHZzamxTCecF2CMEMR2bhjkugfTGkHcq1COkgeDkYpyT-D4qE076k5I59jdnvdSfr8AesRj_CNMTQq85gTdte6JVRHC1C9DncRFoX_62OsN11eTnPl5IaYT7XBMFO_swaZNSXRiinW7VyhevKxRThSq7JQtpLAugJiuN82zLANGR2L-swJOw5KUSWuxeqmRGD_xNvXsoZLRR-U7dcssJXRrAX9QMjqwPnmVwyV6xfmG5s3176kbTHj2pLrFYclR_8YJFEHg7QZObuvFAF850d_7YEqnSZGacYOpSGga0hMHJqg962aOYRgGP2lWxMI2aI3MqT3VBIjpRGYAD5me4X0QM664UQKYTXm3o77G2TOu7JpAuO7Ca_DT98bOLAWFG7FR7GCxPFQI8r-PQLRSTn-xXtFnVDMEgYMY3AQYtuGOdOHZgdCCgt9yZ62DDorcj-BKp06EKbIpkXlfKGB5y06NPpj6HDD8eVW2otYI0t7aq5fDgCrZMpbhzX3ue2bPZVdSwn3aKAqaJMXx1DgCkmKLQu95wbQDO7d0vGVMawa3_aLXe6wipVvBfB4J2mBq56pBD_kyBzMR8UOGCeyNqOimKPfc-YiGJ4V9cg0hBu2_2Nw=w1412-h942-no\"></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><br></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">We enjoyed there till 8:30 AM and started our way back. On our way back we met the priest of the temple outside his house and they offered us tea. I asked about the stay arrangements for the tourists there and then continued our way back. It took us around an hour for the downward trail to reach Kanakchouri. We were back by to our huts by 10. We had a quick breakfast, freshened up a bit and waited for the 11:30 bus to Monkhal from there we were supposed to take another bus to Banswara thereby joining the main road of Rudraprayag to Ukhimath. Soon the bus arrived on time and we put our luggages at the back of the bus. It took around 15 mins to cover the 7 km distance to Monkhal. After getting down at Monkhal we saw one tempo traveller with 4 people onboard waiting with for Banswara. We boarded that immediately but the driver said that it would leave by 12:45. So we waited outside and had a glimpse of the local shops. Slowly we saw the empty seats getting filled up one by one and we also went inside on our seats. Finally before leaving there were around 20 people loaded with hardly any space inside. This was the only means of transport in this region and I enquired that there are 2 more such vehicles that ply on this route one an hour before this and the other one hour after this. The way to Banswara was very scenic. It goes in between agricultural fields and small villages. But the vehicle stopped at almost every door on those villages picking up something and dropping it at another door in a few kms. The journey of 30km approx took us 3 hours. We were getting late as we planned to reach Deoriatal that day. We asked one person at Banswara about the bus timings to Ukhimath and luckily he was also waiting to go there. So we followed him. After a few mins a bus came that took us to Ukhimath along the jostling Mandakini river. On that stretch the riad divides and one of them goes to Gaurikund via Guptakashi. Guptakashi and Ukhimath are on the two sides of river Mandakini but no direct route to commute as it forms a gorge (type of). The bus dropped us at Ukhimath bus stop. On that bus we met a group of 3 tourist who were also planning to trek to Deoriatal that evening. So we agreed to share a vehicle to Sari village for 500. One last bus was supposed to come but that would be too late. We reached Sari within 30 mins and checked for our guide Umendra Singh Negi. Soon he came and met us and after having a cup of tea we started the trek. </span><font color=\"#000000\" face=\"Arial\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">It was not very easy climb specially at a time when the sun is about to hide and with rucksacks. There is a temple of lord Shiva after 15 mins of the climb and there was a source of drinking water coming from spring. We filled our water bottles and continued our trek. It went almost dark and we had to use our torches. Still many trekkers could be seen in the trail. Suddenly we came across 2-3 dhabas and after taking the turn we could the camps laid near the water-body. We took a deep breathe and started looking for our tent which was supposed to be pitched by our guide. It took us some 15 mins to figure that out as there were around 50 tents pitched that day and phone signal was getting disconnected to successfully make a phone-call. Finally after figuring our tent we set our sleeping bags, had dinner at the small dhabas which we saw while coming and went to bed. </span></font></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><font color=\"#000000\" face=\"Arial\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\"><br></span></font></p><p dir=\"ltr\" style=\"line-height:1.38;margin-top:0pt;margin-bottom:0pt;\"><font color=\"#000000\" face=\"Arial\"><span style=\"font-size: 14.6667px; white-space: pre-wrap;\">Here I have mention one sad episode that since there were a number of groups, many of them had brought sound speakers along with them and the nice chirping of the birds were replaced with honey singh :( My take was that honey singh is better at dance floor and not at deoriatal but I learnt that not to come to such popular places in full season when there is a possibility of having such irresponsible crowd. As a consequence we could not find a single bird in that region where Deoriatal is famous for birds. </span></font></p><div><br></div><div><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-style: italic;\">Day 4</span>: Stay at Deoriatal</span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">It was around 6 in the morning, I just opened the zip of our tent and saw cloudy sky and decided to skip the sunrise and lazily went back to my sleeping bag. </span><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">It was a rest day a </span><span style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">much needed rest day</span><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\"> to enjoy the serene beauty of the lake. But as it approached noon light hail storm started and then followed by snowfall. Within an hour the landscape changed and everywhere it was white.</span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"background-color: transparent; color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">Before snowfall</span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><img src=\"https://lh3.googleusercontent.com/Dv9AyeVm8teTeTAkpYAMZ62jFqzBsuSg_Tbf1igEMyxPzeesxoo8sTHIo1NPg-0UDGTnPbepiCQgrHZuOXvzqdJy3geimjOcA-iVLTfGG3qzYx4jD4YqXFlMO6NpcOOZm9zalW5G6j3pCKOTxo221CG8IZXwDzcrs0qRHYn0z4GD54goQkbr8Q_75Q3MNmBcqa12RMZumy0J1x1J-zuB_vQkyttpmfVp_TO-P9xTPxkF_Mk2hfC56g2MXX6H1qe9qm0VJI-YKA3f82Fjje9BQa2jQMWbeIuBhUlON50M4Q_by7z2ll_frAhB0Z8qYx9lG77Cjky22FbMXZLuaS0zgR_AH9sp9x25--3AUbZwRcwgwsExp7qwoU56if3cgGwb5e15V_EkISQ43cvML8gDVDTewfhzfCzq34ZkZYvj17qzSoR1wvhlfNVLp8Cx4eVynF8Nm0_RAQv06eeBifStcYCAJLfFJFzhHeuCHJKPOkOJ2domb9xz8CtfY9Ecyg_1kMxZKvcOQhGnpjTctWtmyn4eONLqwJedFRPdam0DAeS3vd3u3NnM-Q73oEn43Gjmtlw-JlOGRjDhlTJcMKfiBAZF75EifD0rsoRuDiM9iJZDXFwn=w1252-h834-no\"><span style=\"background-color: transparent; white-space: pre-wrap; font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0);\"><br></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">  </span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">After snowfall</span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><img src=\"https://lh3.googleusercontent.com/HZcc7u1qbqQgm-cdI8HgQy5x8CfyIYE5G0POXKCzH-L2ZNSGki4CI2W9TGHdZYFQPxe3nnOOndrQ6DU4oqfkcs0TSAUDLrL0JChkTAr_X2LgfP526wEjFde09muCLuaOe2lPtAty6PwPlB30C8AbyAYrmFpqdSxWLj6VcO4U0C0XBfX0XDn8ZXRoV892R-f9vDwQLfTsYLnEmBpxMIJ9crrjFHtwwZesfBNC1LPAwBDkNicZH7O3INyZO5ICURXVD3z4sZsMZvaQWLL-Zflw3QX8Te3t0K0vUfkGzCIMIu-WgkltSLAlwg9IJYthlXJw4NJYe_TfRdONT0N-_QhRKj7vjhvJaLsQ1ZAQpHDgwR0x_1XStJ_cDJvOVr2JLeo4-VpMmJmOAG7QEo4b6krVoYkBA769ulYaExEZWSl36YzHYENhgdrn6D2KYZT1bObSgMo6xk3Z_gwA5bW2CZYm2NagkLmzadwLR2NEb1A0r4CUpkod-MacVymas3f8aFiGzeU-959-KHTAyjTLtsJvNAEexo6DLgK1kKyIuYI0scRN1nHrcu4-Chu04ozdQCmAs1pNROw2RwT7sOXgVl7FXC7Xom95DNN9CfVGbvND8UfI7kZvTl0K=w1486-h990-no\"><br></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-size: 14.6667px;\"> We also enjoye