span style=\"font-size: 14.6667px;\"><br></span></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-size: 14.6667px; font-style: italic;\"><br></span></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-size: 14.6667px; font-style: italic;\">Day 5</span><span style=\"font-size: 14.6667px;\">: Trek down from Deoriatal to Sari and then to Chopta by a Jeep</span><br></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-size: 14.6667px;\"><br></span></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">Since last night sunset was so majestic I didn\'t to miss the sunrise. Though by 5 AM in the morning I could hear some people beside our camp who were already up by then. It was very difficult to get out of my sleeping bag at 5:30 in pitch darkness and out in the freezing cold but I drew inspiration from another fellow beside our camp who was heading for the watch tower. I quickly took my camera and followed in that direction. Slowly I witnessed the dark shade changing to light blue on the eastern sky but there was still some time for sunrise. Even at such darkness Mt. Choukhamba was visible. I took few snaps against the cliff-side of Deoriatal like a silhoutte. Finally after sometime the Sun God provided his darshan and made the Choukhamba glow like molten gold. The weather was very clear specially after yesterday\'s snow fall.</span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><img src=\"https://lh3.googleusercontent.com/WdUMhem2gj0PGCvpjLqjNejr0lERdBnXkkHtD-Bc5qtxRD6zqiUpisuo2iNZEXM87x1oISylSYKi9rq4mhjbXV5U3KSW_NpbU5tgDLSbm6ho8SM3iZ_aOyJygfTAvr4LUxD3Trn7yY2xpVhxMSjhI6aQb22XQO26OG3AOxYzktmBbPpf1SrZYJ1MoOq8vt4EP6An9z8NC3mTWWxwePHIAvTrExaRYwYpW_2Ql3xMRawTXayV4jhKPrPxRDWy4MMr5S-MVsjqOH5QNSKJMVOH_xxIhPiSQFg4GebPO3ilN0O6fvSMPGNLlQphF5TqK0UykibI3blmMoGxE3NT1dcMPhirtsV2_8C0GJwzFJznm7GqdsfQ6fP9GVhCckbc5rPPEej44BsmwDC4-Ha2RobW-WX2Nki30gJswbhWwFp6SZUa8loL4QCcQHZKOzOWPGjH3YlcVDN3J82Pi10ZbVXoWqDu0E06djbzm-4ulQ6cgDpW_XsrGRIHFDWDfHOz1PHbFgc3asuRzmKhR7fFXuUhZmD4C0UiA6JLgrvrEn0etNWm1Rjsmo0HmEYMn-uvuNNihmlZNrZckDw_tBTJm9563vt8DaMGETXpVziK7tYpMUshYTW4fGyu5Lg66RGHcXqlQlO1g5InOcM6yvs10ovtp59Ts7TecIL716gIqYShyw=w1486-h990-no\"><br></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">First rays falling on numerous peaks at the eastern side of the Kedar peak</span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><img src=\"https://lh3.googleusercontent.com/w_f07I39vyJlrh1ov9R9-rCOn39_bNL5pOoNPbdeudvllLherGIL4Py5NYJ5duNL7S8YO4WMp56eAH7vE0gWHdkm0fxeFBt6SGWZ5yn7QUlJAbcwgpVI_09a8gGZ-AcD-lc4F0nx1Tu5ULoJVy9hjems9uZPOpfEOLdEHRAGGgJT5TY7HGQFdl-1Z4cqMlTQ16dEfLdlzFtfk7nSmv-65OIw7oUhjDXzfTpFGkLyZeVX-2jZDoMdHwHOsi5iZ3HJfICBu0uH6Qbyv_25AmTNkvlWYfL8Wqz8uBWtVQkWe4EUt1jj72PCHpzcpZb55k1465g_LoctSSstH6nzlqoY1sD9leMJklLYRyXt1egR0HAqNlRuMmsrr4DtuabWO2ZUg8BWr2inJ1okNSLj2UpArWg9FUyNT1kQ8xPKT5Y3Zwkf9aPOkHXdrrVx_V6NXU8NxN-NJA_t6-Hm_eBK-z47zlyz4T8fCN10ZbxCQESvUdros0epDfagpfbdwlnCbFdbeVtc0J2ZKaPAwMCDijpNkNgVU2njoU8XqBBSRNOe0kW7gM_ywfBcEYV-D_3dIRewCmTNcQk8Z7QQ4-Zh45xBkO2ZQKpDRO35Is726ERRlaf3rQQ4uGZjL_SHmDLZgTp7kAYL3ozuqS5B_MvdpHUFk-Zit86sIuxuoura12nMHg=w1871-h702-no\"></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">It was a majestic view of witnessing all high peaks of Garhwal region in orangish light. We spent a few hours looking from the watch tower and then returned to our tents for our downward journey to Sari. The downward trek was very quick and we reached Sari in about 45 mins. We recharged our batteries and phones at one shop and hired a small WagonR to Chopta. There was some good and bad news. Once we crossed Makku bend we could see snow on both sides of the road and Duggalbittha I was really scared if the car would be able to reach Chopta due to snow. Finally at one bend the tyre started skidding and we had to start walking on the road. But luckily it was only 2 kms from Chopta so we completed the rest of the journey on foot. After reaching Chopta we looked for the Neelkanth hotel but it was already booked and no rooms were available so we stayed at the hotel just below the slopes of hotel Neelkanth. The sun was overhead and it was very soothing and we decided to take bath after 2 days. But as soon as I poured the first mug my head started aching as if it was about to explode as it was so cold. Nevertheless somehow I managed to take bath and lay at the courtyard of the hotel feeling the sun. We did not do much activity that day apart from a quick walk to the bugiyal on the way to Tunganath and some night photography.</span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><img src=\"https://lh3.googleusercontent.com/mkS5rzlaTYyNmuP-OyVoGqVtd0dNR3HXtNrOh7NYdfmpTJQemK6fNS6LXTwcYRIcbMhQvoySNxjP0eci4OkjKwn_Zxldn_XS7830nAC0xihamTOaGCMw_jgJU2EuaQxbDY2nGxEA8V_lld0oGM8zZiZHRJ4lJNslatJy-okSYoPx9Yy3S7LSHRfcG6QjwsNIbV3WN4UnSjDL9UkmHDmZhkPocxgj4YU7BviEoDo6dL47RA20FncUnfcfTsaCGgnEt7sMucPb2zJMMb9I2Vrfh_m-GyA85Uj21QxSXK34WaDFUW1XBtYR0_mcPlBlVQMJiHWBFnJI3FXsUXQ6CC5-ymgknMu8x0CGBWkGw-5zoifNIoFEf-cx0NVKk-b0Oq04FJbvXoWxVgcpF9LIHH791Bw8_eKOZUyNxgepZl10Ti_kv5308Uk57eb-ZozdBXX901gj7ESsd_XBs_qaQ6h8Z0WwT2TmBH4Qg7azJoRMLPIZ84thIEM_3cPnlKb92tm0nVEDnSjZQ4FV3wmraxV57A2MXJznx3nlUmXvHp514GSU9VWLPpzpn5vHEBO_BJ9Ti-NtSjoJNSek6Xe1yEP0Clb6cPgbSvrxBaRiwFkMCYmHjszL5xpr=w660-h990-no\"><br></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><br></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-style: italic;\">Day 6</span>: Trek to Tunganath, Chandrashila and back to Ukhimath</span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-style: italic;\"><br></span></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\">It was a bright sunny and chilly morning and I was already overjoyed by the sheer thought that what scenic view we might be getting at Chandrashila today. After having a heavy breakfast and packed Aloo Parathaas as lunch from we started our trek. Chilly winds across my face made brought shiver down my spine but once we got into the rythm it was comfortable. After 30-30 mins we reached the same bugiyal which we came yesterday evening. There is a small hut which serves tea, maggi and water bottles and this was the last stop to replenish any stock. Since we already had packed everything in advance we did not stop here and continued our trek through the icy boulder-cement trail. I would say that the trail till Tunganath is well laid but with snow and sun there is always a risk of slipping and getting injured. We drifted from the actual trail because of the slipping and started climbing straight against the slopes. It was bit tough but after a 3-4 climbs we reached a bend from where a small temple could be seen and the green roof top Forest rest house. We continued and in another 10 mins we reached that small temple and from this place the other side (rudraprayag side) of the valley can be seen. we continued after taking a few snaps and finally reached the Tunganath temple. There were quite a few shops but all were closed. I think they remain open from April to October. Spent a few minutes there and then looked straight up towards Chandrashila peak. The road to Chandrashila bifurcates few metres before Tunganath but I preferred to follow the shourtcut from the front side of the temple. After few hunderd meters from Tunganath there is another bifurcation. We took the road which other people were taking. From there there was no roads its simple climbing the slopes at 50-60 degree inclination. I forgot to put the SPF sunscreen on my face and soon I could feel the burns on my forehead. I tried to cover my face using the hood of my sweat-shirt. It took another 40 mins from Tunganath to reach Chandrashila. As I had seen in many earlier videos, the temple of Mata Ganga.&nbsp;</p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><br></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><img src=\"https://lh3.googleusercontent.com/de-2RuJQQlauOzbDcY6iA5dQHCt7VDAkR0DpYAhQ-tIkBudJ47dIkhKeV76zycJObWjqCd5qWTFtIbcwM7EAOtPQI4YrbdC53-kEPuVtk2psJaTiNIBLUuQwlcRhCNqFPY-gEEOwRH3M0nZrwVpP0tcuIensu7s6JYX9zqRJ16GMjvCzZzxXv_aG3xy0qr73PNbTBm4WzNKyoMhNdx1WTF9n72mcH0PhkbsxtJkpaurXbJkDk1QsfF8cYLk6OfSAkXQV2tim7GgeNMI2lA7qD1WEOEddN11k7eHG4IUGu8Q9REWbfpIljhLM47ck8reEb_b4gvom8DCQJZeiBO0LhTbmm9DzNB2s6_qZGlJ3ZAHMCMLfGlYk30FrNvjM2LzCuMQk18re2wKrJOtiRfqh4RkjR9SnwWDt683lMvKzNyh0uK2eYYHxBbI2ZqDdX_Sbmr4H8q0qqEUagVbloQ4SWsUIlxUn972Vm1IzFQrBW6uC0H5T5hmoSe-lLJ-smUy_KAVDtRjRRRvjQdUFXaw94ov_RUp4ppQTc_9kC1oSohk0vkkRvhOhxC4eLxCn3ABJD3HoCwxVvuQLG0i4UI366tHCjj3toGb_RRV4J4fT7Gtlf6MB=w556-h834-no\"><br></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><br></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\">Then I started looking at the mighty Nanda Devi peak which was very far but still stood like a White Wall.&nbsp;</p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><br></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><img src=\"https://lh3.googleusercontent.com/p9niHNeTfX8MDfnLjhf3ti5qE1nTqbV7JYcawT2NFPdsUpyT4k72kxnT5SZH3ONkrvcJprokj5TRYAVnb85eamm-9h4iWxw8YFI5L-ojHjw4GZcqyv-YCsuDg-C6ALkbpqfuq1fd2mhS7WSEJG3dVojw5PbnKmRdsZsT6ZXUDUb4Ow1t6zFRT5619_TtLw-pjO1q-OecKG0famAKLIbFtTe1-FQJCuAJhq2GncxknxLYs4YRbdUHMARwDG9TInjxiRufUv_kkNzHzwnb3QCQsg90xuXsWPhe4VHeVFvzdgABqjB86j7kuy8qKyL3nK1v3htpVVPHh5ezFtDpp82kNottNyCvXfzK27yaCBgVRMAYFPZ7qZUsy52iikjj1w0glNjwWvR4JgvZNdojVTo-d6TSzGJ9aXYkLgpmCF9BRMt-CamaIrsqf0lXN1PBSMN9CatvZaM4jon5JWcCPLCymlEXIp-KFNZudUSonA7X5x08nfR3euR9S1zYvqzf_LajduQ0eMKsM3ExmGE42gRmZVzRzVtPYV21aVgpl04lUV3pAuBKitSNjCdJMRehCSiPbzDLlIr2Nv1K3WuU3NVyKYQgX8nTgYD2zLtXvQI7TnASB7ky=w1252-h834-no\"><br></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><br></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\">Truly 360 degree view ! Before coming here I was wondering how the weather would behave but I couldn\'t have expected for a better weather. The Choukhamba and Kedar peaks were now a familiar ones. From left to right the Jaonli, Gangotri, Thalay Sagar, Kedar Dome, Sumeru Parbat, Bhagirathi, Mandani, Jankuth, Choukhamba, Trishul, Nanda Devi, Nanda Ghunti etc could be seen. I just tried to feel that moment and sit quietly taking photographs. Even at the southern side the Kartikswamy temple could also be seen along with the other valleys holding the tiny villages.</p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><br></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><img src=\"https://lh3.googleusercontent.com/e0kXm2MRYISc0QQ2c4_DFgmCvVV4w7K5j6mm7lirmDfUdgVIEE1wE4N1vD-wfkmV-IFDizo2lgE6KBJjNzPcyZZ7rei-WAIFvqbdB0lT4laSwsPVB_ZpguabJ2rGCZh6YCGlUNOzAs7icFMx24NZ502LtxRJPmFojfhmiMgNiMh2-45QVpEF4NWuvhJUOReNR7T1_SjjwHilfNJojOdptspzlefBKyuBSa7LXmsvn3Kbbv8m9WKhHgQGHsl6yS5JTasyi4oq9W_azrerDq0_GrvAm4CNiZhBeMdpk4Bl-_RluakXOQxgjG5k6Tt6XldIpqhcLzylZrVOXvsBXyZ9rxKGvRjktwAP4TiLsHtLlYYwbQqwhC086twSOIgYBwqVjTFzpKN-1dzZ1ad6Q9QYws1iQ3aGh4zhjoNgsMdOp9pjxfr6WcNTEEnafGX51T45rMG4wA4k4_JpDZM_QGV-_hrVSa0ytkpc_KsdAGORwRAN0ETg_Cg4jm9pif179XzqrtId6o-RjXjnwCtcJQ54YGKrGoDXxaRWVztta3LUklzXvfcpJi4hSXmDJsxwtZCq-cAs6If1lGE-PHiLydvY76qCjSyIU5UHcQl8NLkcIbtcr8o_=w1252-h834-no\"><br></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-style: italic;\"><br></span></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">Finally, it was time for us to leave as we were to reach Ukhimath by today. We started our trek downhill on the same route. Though coming down the trail was painful for the knees but we made it in about 1.5 hours time.</span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\">As per our conversation with the hotel manager a Jeep was waiting for us. We quickly had some snacks and started for Ukhimath. It was a short 1 hour journey and it dropped us at the Ukhimath taxi stand. We decided to book a nearby hotel as it will be easier to board the bus next day. After checking with some locals we got to know that there is a bus which leaves at 5:50 in the morning for Dehradun and it goes via Rishikesh. We planned to travel in that bus and quickly book ed a nearby hotel. I checked with the hotel staff and he informed me that the Omkareshwar temple is nearby and was visible form the hotel balcony. We decided to pay visit to this temple as the Kedarnath and Madhyamaheshwar idols are worshiped here during the winter season and getting to witness both of them at one place was not to be missed. We took the short cut trail through some agricultural fields and houses converging into a another road and from there the temple was very near which otherwise would have been a 3 km walk. We reached the temple just at the time of aarti and I experienced one of the best Sanskrit pronunciation of mantras there. After that we had dinner and went to bed early.</span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-style: italic;\"><br></span></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"font-size: 14.6667px; font-family: Arial; color: rgb(0, 0, 0); background-color: transparent; vertical-align: baseline; white-space: pre-wrap;\"><span style=\"font-style: italic;\">Day 7</span>: </span><span style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">Ukhimath to Haridwar via Rishikesh<br></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\">As per our plan we woke early morning at 4:30 AM and were ready in an hour. It was still dark outside and the lights from Guptakashi could be seen. Since our hotel near the bus stand we walked there and saw a bus waiting. On checking we found that it was our bus to Dehradun and we were supposed to get down at Rishikesh. We boarded that bus and reached Rishikesh by 12:30 noon and from there we took another bus to Haridwar. Bus service from Haridwar to Rishikesh is very frequent often every 30 mins and bus fare in govt buses are Rs. 35. I was having mixed emotions partly because our trip was about to end for which I dreamt for the last 2 months and another part a sense of deep satisfaction on witnessing the Garhwal Himalayan ranges under clear blue sky after about 10 long years. But none of my Garhwal trip ends without taking a dip into the holy Ganges and experiencing the evening Ganga aarti at Har-Ki-Pauri. </span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><img src=\"https://lh3.googleusercontent.com/R7BLr2IPT-s6HZeTkRqHLPkTAblsZiE7DAVkSQP31VBSsZcjy78WhNrvErRj0H-pCBjd4K742z3naIYAJItqy_O32zFC-LbdL9tlKXWy0kff1SXIyjH7mHr2N0XDTSY87IHlrWYKp-Jlwb77ay2vQB9AJDi8xgHUROSx9Sv93zqBHLPpMyBFXLzYQlrQPfvVnQ8Pw6GHHqdww1K2w8eVJHMQBd6nOrWjxTcoXf5CK-nS-AlE16uC2asKbP4LvNbcOINSfN-Kjnd0wsaoZJNlIUpF-HZYyXSaHFFsMC1fWCl-hA6SytgatxZTwL7CY0ViquTOYK4gtEMxzT8VfDz2yCPsbUO_IrIjKh328O1m1ismq1utQALmvoalioFHuAv9JrNiDZbZjM-k-BiqA2YaAnJ9QRAdWEOn84TsSHJfdXshD90mhm6MNRkhU_wY7Xm4oTnwBwYOTYHJxHmNc43raRF5v9wrBGK_4j0JiTc_Rjxit5Y9wCbf-zwYm2Z8N7BzaB0S7cZCeSawHDxdoHYzNfd-iOAndFI-3kc_KW0YgJWYGXXOLorGhrXZCXzYp9E3PYB1L4EilOxwRNFTS-aKpRGw5ldLR4S76BeEHf3ZpkmOgJcc15Hr=w1676-h990-no\"><span style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\"><br></span></p><p dir=\"ltr\" style=\"margin-top: 0pt; margin-bottom: 0pt; line-height: 1.38;\"><span style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 14.6667px; white-space: pre-wrap;\"><br></span></p></div></span></div></div><div><div><span><br></span></div></div>','COMPLETE','trek, blog, travel, himalaya, chandrashila, deoriatal, kartikswamy, kanakchouri, himalayan trek');
